INSERT INTO `explore` VALUES (1,'Bungur','Lagerstroemia speciosa','Not extinct (Tidak punah)','Kingdom : Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo : Myrtales\nFamili : Lythraceae\nGenus : Lagerstroemia\nSpesies : Lagerstroemia speciosa','Batang tegak, silindris, permukaan batang licin dan mengelupas tipis, berwarna abu-abu kecoklatan.\nDaun tunggal, berpasangan, entire, berbentuk bundar telur hingga lonjong, berwarna hijau tua, daun muda berwarna merah jambu.','Bunga majemuk berwarna ungu, tersusun dalam malai, panjangnya 10-50 cm, terletak pada ketiak daun atau ujung ranting.\nBuah kapsul berkayu, berbentuk bulat sampai bulat memanjang, panjang 2-3,5 cm, beruang 3-7, buah muda berwarna hijau, setelah masak menjadi cokelat, buah masak akan pecah.\nBiji berjumlah banyak, berukuran kecil, pipih dengan ujung bersayap berbentuk pisau, berwarna cokelat kehitaman.',104.0,NULL,'Tumbuhan asli Asia Tenggara.\nBunga hanya mekar sekali dalam setahun pada puncak musim panas.\nPemanfaatan di Filipina, Taiwan dan Jepang, daun bungur dimanfaatkan untuk teh herbal. Di Vietnam, daunnya dikonsumsi untuk sayuran. Di Indonesia, sudah sejak zaman dahulu pohon bungur banyak ditemukan sebagai tanaman perindang dan penghias tepi jalan. Dalam bukunya “The History of Java”, Sir Thomas Stamford Raffles menyebut bungur sebagai salah satu bunga terindah di Jawa.','15c9XyWXB_JaW566c6snt8EKUEpy7uhVf','1iZ2Ffupyzbe_YD8Tw_R3kpf9xVYn_dFY'),(2,'Manglid','Manglietia glauca','Not extinct (Tidak punah)','Kingdom : Plantae \nDivisi : Magnoliophyta \nKelas : Magnoliopsida \nOrdo : Magnoliales \nFamili : Magnoliaceae \nGenus : Manglietia\nSpesies: Manglietia glauca','Daun tunggal, tersebar, spiral, bentuk bundar telur memanjang atau jorong memanjang, panjang 10-25 cm, tanpangkal daun runcing, tidak berbulu, permukaan bawah daun berwarna abu-abu kebiruan, permukaan atas hijau muda agak mengkilap.','Bunga terminal, soliter, besar, bertangkai panjang 2-4 cm terletak pada ujung ranting, besar, mahkota bunga berwarna putih kekuningan, harum, kelopak 9-13 tersusun dalam 3 lingkaran.\nBuah majemuk, berbentuk kerucut (kegelvormig) panjang 6–8 cm, pada permukaan berwarna hijau dengan titik-titik putih, kemudian menjadi coklat hitam.\nBiji 2-6 butir, kadang sampai 12, berwarna merah.',97.0,NULL,'Di Jawa Barat dan Bali kayu jenis ini sangat disukai karena selain kayunya mengkilat, strukturnya padat, halus, ringan dan kuat. Kekuatan kayunya digolongkan dalam kelas III dan keawetanya kelas II. Adapun keuntungan dari kayu Manglid tersebut karena ringan yaitu dengan berat jenis (b.j.) 0,41 sehingga mudah dikerjakan, dan karena kekuatan dan keawetannya jenis kayu tersebut sering dijadikan bahan baku pembuatan jembatan, perkakas rumah, dan barang-barang.\nSelain itu, ekstrak daun manglid dapat digunakan sebagai penghambat pertumbuhan bakteri Bacillus subtilis oleh fraksi kloroform pada konsentrasi 2,5%. Sedangkan jamur Alternaria solani (Jamur pada tomat) dan Sclerotium oryzae (jamur pada padi), fraksi kloroform dapat menghambat pertumbuhan mulai pada konsentrasi 0,5% dan pada 1,5% jamur tersebut tidak tumbuh sama sekali.','12jQ-ECT1WI690NTcOcYrvbqlBMvVEP3Z','1oIdekE8sxcD9DcUNC-6aTaJxJ9-P7gda'),(3,'Surian','Toona sinensis','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta \nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Meliaceae\nGenus: Toona\nSpesies: Toona sinensis','Kulit batang berwarna coklat, halus saat muda, menjadi bersisik sampai berbulu di saat dewasa.\nDaunnya menyirip, sepanjang 50-70 cm dengan lebar 30-40 cm, dengan 10-40 lembar, daun tunggal biasanya tidak ada (paripinnate) terkadang ada (imparipennate); daunnya biasanya sepanjang 9–15 cm dan selebar 2,5–4 cm, dengan tepinya bergerigi halus pada sebagian atau semua bagiannya.','Bunga diproduksi di musim panas dengan bentuk malai sepanjang 30-50 cm dari ujung cabang; setiap bunga kecil, berdiameter 4-5 mm, dengan lima kelopak putih putih atau pucat.\nBuahnya berbentuk kapsul dengan panjang 2–3,5 cm, mengandung beberapa biji bersayap.',70.0,NULL,'Tumbuhan asli Asia Tenggara.\nDi Tiongkok dan negara-negara Asia Tenggara seperti Malaysia, daun mudanya digunakan sebagai bumbu untuk tujuan berikut:\n-Untuk disajikan dengan bubur tawar sebagai sarapan dan makanan sederhana.\n-Untuk meningkatkan rasa hidangan atau sup.\nKayunya bernilai dan sering digunakan untuk pembuatan furnitur dan badan gitar listrik. \nSalah satu pengganti Swietenia macrophylla.\nSejauh ini merupakan satu-satunya spesies dari Meliaceae yang paling toleran terhadap dingin dan dapat dibudidayakan dengan sukses di Eropa utara.','1VuIolyYYxALNhXMiyOqFKiDhKzfVEifz','13Js-UETX53qUyesEQKbLdXcgLzCvKHxv'),(4,'Mahoni','Swietenia macrophylla','Vulnerable (Rentan)','Kingdom: Plantae\nDivisi: Magnoliophyta \nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Meliaceae\nGenus: Swietenia\nSpesies: Swietenia macrophylla','Kulit batang berwarna abu-abu dan halus ketika\nmasih muda lalu berubah menjadi coklat tua, menggelembung dan mengelupas setelah pohon berumur tua.\nDaun bertandan dan menyirip, panjangnya antara 35 - 50 cm, tersusun bergantian, teksturnya halus, terdapat 4 - 6 pasang anak daun dengan panjang antara 9 - 18 cm.','Bunga kecil berwarna putih, panjangnya 10 - 20 cm, malai bercabang.',86.0,NULL,'Tanaman ini dikembangkan pada awalnya di wilayah Jawa sejak jaman penjajahan Belanda.\nKayu mahoni mempunyai nilai ekonomis yang cukup tinggi sehingga dibudidayakan untuk keperluan sumber bahan baku industri.\nKualitas kayunya keras dan memiliki warna kemerahan, sangat baik digunakan untuk meubel, furniture, barang-barang ukiran dan kerajinan tangan. Kayu mahoni memiliki kualitas yang mendekati kualitas kayu jati sehingga sering dijuluki sebagai primadona kedua.','1XK9rzzX73RgxWCu_09d5zjcmW-5O4fz-','123wt0Go1LEmg3ip3neuHETg4top_bJAS'),(5,'Sasalaman','Syzygium sp.','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Myrtales\nFamili: Myrtaceae\nGenus: Syzygium\nSpecies: Syzygium sp.','Pohon berukuran sedang dengan kulit batang berwarna coklat abu-abu, memecah atau bersisik. Daun tunggal terletak berhadapan, dengan tangkai hingga 12 mm. Helai daun berbentuk jorong-lonjong, jorong sempit atau lanset, 5-16 x 2,5–7 cm, gundul, dengan 6-11 urat daun sekunder, dan sejalur urat daun intramarginal tampak jelas dekat tepi helaian, berbintik kelenjar minyak yang sangat halus.\n\n','Karangan bunga berupa panikula dengan banyak kuntum bunga yang muncul di bawah daun atau kadang-kadang pada ketiak. Buah buni membulat atau agak tertekan berukuran 12 mm, bermahkota keping kelopak, berwarna merah sampai ungu kehitaman apabila masak.',4.0,NULL,'Memiliki bentuk yang mirip dengan daun salam yamh digunakan terutama sebagai rempah pengharum masakan di sejumlah negeri di Asia Tenggara memberikan aroma herba yang khas namun tidak keras.','13nYoAzdbj0Wo7puiikeS82NLVGs-7_2k','4eJFTSoVB6PjOQ05GtEuI?usp=sharing'),(6,'Puspa','Schima wallichii','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Ericales\nFamili : Theaceae\nGenus: Schima\nSpesies: Schima wallichii ','Berhabitus pohon dengan tinggi mencapai 40 m, mempunyai ciri khas daun berwarna kemerahan ketika muda dan hijau ketika tua. Daun tunggal, tersebar spiral, berbentuk lonjong-jorong dengan ujung runcing dan tepi daun halus-bergerigi. Berakar tunggang dengan batang berwarna kecoklatan. kulit kayu tebal dan memiliki kayu teras berwarna coklat kemerahan.','Memiliki bunga tunggal yang tumbuh pada bagian ketiak pada ujung ranting. Bunga memiliki mahkota berwarna putih yang saling melekat pada pangkal dan memiliki benangsari yang banyak. Buah berbentuk kotak hampir bulat dengan biji memiliki sayap.',2.0,NULL,'Memiliki resistensi yang tinggi dan tergolong ke dalam tanaman fire tolerant. IBatangnya digunakan sebagai bahan baku bangunan dan daunnya digunakan sebagai pakan untuk ternak atau hewan lainnya. Sering dimanfaatkan juga sebagai pelindung serta reklamasi lahan dan reboisasi daerah tangkaoan air. ','1HWA0AomC0qYOLHub-eaVPSUXvwYUfYJ0','9tdo8ZkAv22gVn6-3QHbR?usp=sharing'),(7,'Sintok','Cinnamomum sintoc','Critically Endangered (Terancam kritis)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Laurales\nFamili : Lauraceae\nGenus: Cinnamomum\nSpesies: Cinnamomum sintoc','Batang silindris dengan tinggi mencapai 40 m dan diameter 90 cm. Kadang berbanir, kulit batang licin, mengelupas kecil, dan berwarna kuning muda atau cokelat muda. Bagian dalam batang berwarna cokelat kemerahan dan mempunyai bau seperti cengkeh. ranting silinder kokoh denga diameter 1,5-2,5 mm, tidak berbulu, kering dan kehitaman. Daun berhadapan atau hampir berhadapan dan memiliki pangkal daun runcing (acutus). Tulang daun menjari tiga, daun muda berwarna merah-ungu kehijauan, permukaan daun mengkilap, tidak berbulu, berbentuk elips sampai ovatus, dengan ujung daun lancip. ','Bunga berbulu lebat dan mempunyai pedicel. Buah berbentuk ellipsoid atau obovoid. Ketika muda buah berwarna hijau dan berwarna hitam keunguan ketika tua.',33.0,NULL,'Tanaman ini cenderung individual dan biasanya ditemukan di antara perdu dan semak-semak hutan sekunder pada daerah yang tidak ternaungi atau terbuka. Termasuk ke dalam tumbuhan obat langka di Jawa.','1jdAbOhjX8ll5dcatOGDhpBuoLkhytlrw','iK-BLzP9P00qkPBrDJVwp?usp=sharing'),(8,'Jati Putih','Gmelina arborea','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Lamiales\nFamili : Lamiaceae\nGenus: Gmelina\nSpesies: Gmelina arborea ','Berhabitus pohon dengan ukuran sedang, tinggi dapat mencapai 30-40 m. Batng silindris dengan diameter rata-rata 50 cm kadang mencapai 140 cm. Kulit halus atau bersisik, berwarna cokelat muda sampai abu-abu. Ranting halus licin dan berbulu halus. Daun bersilang, bergerigi, atau bercuping, berbentuk jantung dengan ukuran 10-25 cm x 5-18 cm.','Bunga kuning terang, mengelompok dalam tandan besar (30-350 bunga per tandan). Bunga sempurna dengan panjang mencapai lebih dari 25 mm, berbentuk tabung dengan 5 helai mahkota. Buah berdaging dengan panjang 20-35 mm, kulit mengkilat, mesokarp lunak, agak manis, dan bijinya keras. Panjang biji mencapai 16-25 mm, permukaan licin, satu ujung bulat, dan ujung lainnya runcing.',4.0,NULL,'Pohon penghasil kayu untuk bahan konstruksi, furniture, pulp, dan lain sebagainya. Akar, daun, bunga, dan kulit digunakan sebagai obat','1nI0bzyT3khsQdjpNFEQ0HMcRb8IjoNq9','0aF6pYlfUZ1Gg8wm70147?usp=sharing'),(9,'Ramayana','Cassia spectabilis','Low Risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Fabales\nFamili : Fabaceae\nGenus: Cassia\nSpesies: Cassia spectabilis','Pohon besar dengan tinggi mencapai 4,5-8 m. Daun majemuk menyirip bergantian 7-15 pasag selebaran.','Bunga berwarna kuning cerah dengan lebar sekitar 1,5 inchi. Perbungaan besar dan malai berdaun. Kelopak berwarna kuning berbentuk sendok, putik ramping, melengkung, berbulu. Buah berbentuk silinder panjang atau polong rata. Awalnya berwarna hijau kemudian menjadi gelap atau hitam setelah matang.',41.0,NULL,'Digunakan sebagai obat demam, sakit kepala, kurap, anti inflamasi, flu dan pilek dan masih banyak lagi.','1RBrTHeqVZfb03TXTjdi2tk6aNEqjI2x5','VFJC-Zgnawr9pefzvtR8I?usp=sharing'),(10,'Mindi','Melia azedarach','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta \nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Meliaceae\nGenus: Melia\nSpesies: Melia azedarach','Pohon dengan tinggi mencapai 40 m, diameter 60-180 cm, bercabang banyak, batang silindris dan tidak berbanir. Kulit kayu berwarna abu-abu cokelat, beralur membentuk garis-garis dan bersisik. Daun majemuk menyirip ganda, tumbuh berseling dengan panjang 20-80 cm, anak daun bundar telur atau jorong, tepi bergerigi, berwarna hijau tua di bagian permukaan atas.','Bunga majemuk dalam malai, panjang sekitar 10-20 cm, dan keluar dari ketiak daun. Mahkota berjumlah 5, panjang 1 cm, warna ungu pucat dan harum. Buah tipe buah batu, saat masak berwarna cokelat kekuningan.',20.0,NULL,'Kayunya digunakan sebagai bahan bangunan, Kulit, akar, dan daun sebagai obat herbal. Memiliki tajuk yang khas dan dimanfaatkan sebagai pohon hias di tepi jalan.','1kNAKcrzG2nLpKIo-1exXupzB1Squw-mc','8a159wIXClG15yUaPQXp1?usp=sharing'),(11,'Kemiri','Aleurites moluccana','Low Risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Malpighiales\nFamili : Euphorbiaceae\nGenus: Aleurites \nSpesies: Aleurites moluccana','Pohon besar dengan tinggi mencapai 40 m. Kulit batang berwarna abu-abu, sedikit kasar dan berlentisel. Daun muda, ranting dan karangan bunga dihiasi rambut bintang yang rapat, pendek, warna perak mentega. Daun tunggal berseling, hijau tua, bertangkai panjang hingga 30 cm. mempunyai sepasang kelenjar di ujung tangkai. Daun berbentuk bundar, bundar telur hingga lonjong atau menyegitiga. Pangkal dau berbentuk jantung, tulang daun menjari.','Perbungaan dalam malai yang terletak di termial atau ketiak ujung. Panjang bunga 10-20 cm. Bunga berkelamin tunggal, putih, bertangkai pendek. Kelopak bertaju 2-3, mahkota berbentuk lanset. Buah batu agak bulat telur gepeng, warna hijau zaitun di luar dengan rambut beledu, berdaging keputihan, tidak memecah, berbiji 2 atau 1. Biji bertempurung keras dan tebal, agak gepeng.',2.0,NULL,'Bijinya dimanfaatkan sebagai sumber minyak dan rempah-rempah. Bijinya juga dapat dimakan jika dipanggang terlebih dahulu','1rkkcEigoQYo94Q7SKwfOIUazfp5cvC1A','-jMDiZV0FEYdpCXep-WBV?usp=sharing'),(12,'Surian Daun Lebar','Toona spectabilis','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta \nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Meliaceae\nGenus: Toona\nSpesies: Toona spectabilis ','Pohon berukuran sedang - besar dengan kulit batang berwarna coklat, halus saat muda, menjadi bersisik sampai berbulu di saat dewasa. Daunnya menyirip (majemuk pinnatus), sepanjang 50-70 cm dengan lebar 30-40 cm. Setiap tepi anak daun bergerigi halus pada sebagian atau semua bagiannya.','Bunga diproduksi di musim panas dengan bentuk malai/panikula sepanjang 30-50 cm dari ujung cabang; setiap bunga kecil, berdiameter 4-5 mm, dengan lima kelopak putih putih atau pucat. Buahnya berbentuk kapsul dengan panjang.',14.0,NULL,'Pohon penghasil kayu untuk bahan konstruksi, furniture, pulp, dan lain sebagainya.','11q0Zu59WXN61GNmsAk95v9FV362Hz3OO','Q_s8PlOGddFAHbQChys27?usp=sharing'),(13,'Mara','Macaranga denticulata','Belum terdaftar IUCN Red List','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Malpighiales\nFamili : Euphorbiaceae\nGenus: Macaranga \nSpesies: Macaranga denticulata','Mara merupakan pohon yang tinggginya bisa mencapai 15 m hingga 20 m, mmemiliki banyak cabang, batang, dan ranting kadang kala berduri. Batang pohon mara bergetah putih. Daunnya merupakan daun tunggal yang memiliki filotaksis spiral. Tangkai daunnya panjang melebihi panjang helai daun. Helaian daun tipis berbentuk seperti jantung (cordate).','Pohon mara memiliki bunga yang tumbuh berkelompok dengan ukuran kecil dan terlindung oleh braktea atau edaun pelindung bunga. Bunga-bunga kecil tersusun dalam perbungaan rasemus.',15.0,NULL,'Kayu dari pohon Mara yang ringan dapat diperjual belikan untuk menjadi kayu konstruksi dan furnitur rumah. Getah dari pohon mara dapat digunakan sebagai bahan karet atau perekat.','1jXGiX_x-xtqBHb02hf4kH_pnav9RR5jS','NAC6_rvILSxAPPyd3Z-Ar?usp=sharing'),(14,'Kedoya','Aphanamixis grandifolia','Belum terdaftar IUCN Red List','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Meliaceae\nGenus: Aphanamixis \nSpesies: Aphanamixis grandifolia','Kedoya memiliki batang pohon berukuran tinggi mencapai 32 meter mengisi kanopi bagian tengah. Kulit batangnya berwarna coklat kemerahan Memiliki daun majemuk pinnatus yang tersusun secara tersebar.','Bunga pohon kedoya merupakan bunga majemuk yang tersusun secara panikula. Setiap bunga berukuran kecil berwarna kuning. Buah berwarna ungu kekuningan dengan diameter 25 mm. Setiap biji kedoya memiliki arilus berwarna merah.',4.0,NULL,'Kedoya sering berbunga ketika pohonnya masih kecil Kayu pohon kedoya bisa digunakan sebagai bahan bangunan. Biji kedoya dapat diekstrak agar menghasilkan minyak untuk bahan membuat sabun.','1WieDSZhHMNk3p-SVy_rXBX8WuFSFTOYd','At7GulJlCUK3950XTyLms?usp=sharing'),(15,'Petai','Parkia speciosa','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Fabales\nFamili : Fabaceae\nGenus: Parkia \nSpesies: Parkia speciosa','Pohon dengan tinggi mencapai 30 m. Daun majemuk, menyirip ganda, kedudukan berseling, bertangkai panjang.','Bunga majemuk, tersusun dalam bongkol yang muncul di ujung ranting. Buah bertipe polong, memanjang. Dalam satu buah terdapat 20 biji berwarna hijau ketika muda dan kering ketika masak. Buah terbalut selaput agak tebal yang berwarna cokelat terang.',13.0,NULL,'Kayu sering dimanfaatkan untuk membuat furnitur atau bahan bangunan. Buah, biji dan daun muda dapat dikonsumsi. Daun dan biji digunakan sebagai obat berbagai penyakit.','10PCLiBz0aXs5-Drgj_VJ76TtDzPkwvLN','3W4MykEUAEEAQv3uQXoRb?usp=sharing'),(16,'Trembesi','Samanea saman','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Fabales\nFamili : Fabaceae\nGenus: Samanea\nSpesies: Samanea saman','Pohon dengan ketinggian mencapai 30-40 m. Batang tidak beraturan kadang bengkok, menggelembung besar. Daun majemuk dengan panjang tangkai 7-15 cm. Permukaan kulit sangat kasar dan terkelupas. Pohon berwarna kecokelatan saat tua. Daun melipat saat hujan dan di malam hari. Lebar daun 4-5 cm berwara hijau tua. Permukaan daun bagian bawah memiliki beludru dan terasa lembut.','Bunga berwarna putih dan bercak merah muda pada bagian bulu atasnya. panjang bunga mencapai 10 cm dari pangkal bunga hingga ujungnya. Bunga menghasilkan nektar yang mampu menarik serangga. Bgenang sari berjumlah sekitar 20-30 yang panjangnya 3-5 cm. Buah berbentuk lurus agak melengkung dengan panjang 10-20 cm, lebar 1,5-2 cm, dan tebal 0,6 cm. Buah berwarna cokelat kehitaman ketika matang. Biji tertanam di dalam daging dan berwarna cokelat kemerahan yang sangat lengket dan manis berisi sekitar 5-25 biji dengan panjang 1,3 cm.',15.0,NULL,'Disebut Pohon Hujan karena air yang sering menetes dari tajuknya yang disebabkan kemampuannya menyerap air tanah dengan kuat. Mampu menyerap CO2 puluhan kali dari pohon biasa','1paD-itvQFxF0OphcoCSZgCdOhimoFd8t','G8qNb9cAKQn7fMy25N-Zr?usp=sharing'),(17,'Alpukat','Persea americana','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Laurales\nFamili : Lauraceae\nGenus: Pesea\nSpesies: Persea americana','Mempunyai tinggi sekitar 3-10 m, berakar tunggang, batang berkayu, bulat, warna cokelat, dan memiliki banyak cabang. Daun tunggal bertangkai sepanjang 1,5-5 cm yang letaknya berdesakan diujung ranting, ujung dan pangkal daun meruncing. Tepi daun agak menggulung ke atas.','Bunga majemuk, berkelamin dua, berwarna kuning kehijauan. Buah berbentuk bundar dan bulat telur, berbiji satu dengan diameter 2,5-5 cm dan keping biji berwarna putih kemerahan. Daging buah berwarna hijau kekuningan saat matang dan bertekstur lunak.',53.0,NULL,'Tumbuhan ini berasal dari Meksiko dan Amerika Tengah. Buah alpukat dapat dikonsumsi dan digunakan sebagai bahan dasar kosmetik seperti masker','1diIF82eG2_srd73PS7bzR7j3a-ctobVN','pLmYyB64z-8gxpqDbPZ12?usp=sharing'),(18,'Kicangkudu','Tarenna incerta','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo : Gentianales\nFamili : Rubiaceae\nGenus: Tarenna\nSpesies: Tarenna incerta','Permukaan batang ada lekahan, batang dikelilingi lampang, ranting segiempat berwarna coklat, helaian daun jorong, pangkal daun tirus, petiole berbentuk silindris, tulang daun sekunder datar, tulang tertier terlihat menjala, ada daun penumpu,','Letak perbungaan di terminal, perbungaan malai rata, estivasi kelopak dan mahkota menyirap, mahkota berbentuk tabung, tangkai perbungaan lebih panjang dari tangkai daun, bunga brwarna putih. Berbiji bulat, permukaan biji kasap dan biji tidak bisa berdiri.',12.0,NULL,'Tanaman endemik Jawa Barat','1RHgSZtEcj-KDZlzY2Pw3ZCAVEDXjhy1m','j2-8JxhzgG6ioawIAyEqk?usp=sharing'),(19,'Mahoni Uganda','Khaya anthotheca','Vulnerable (Rentan)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Meliaceae\nGenus: Khaya \nSpesies: Khaya anthotheca','Pohon dengan tinggi mencapai 60 meter. Permukaan batang muda berwarna keabuan dengan tekstur halus dan menjadi lepas dalam bentuk kotak saat dewasa.\nDaunnya majemuk terdiri 3-7 pasang anak daun, berbentuk oval atau jorong, bagian atas berwarna hijau gelap dan bagian bawah berwarna hijau terang.','Bunganya berukuran kecil berwarna kuning.',97.0,NULL,'Kayunya tahan terhadap hama rayap dan serangga serta jamur pelapuk sehingga bagus digunakan sebagai bahan baku furniture, lantai dan bahan pembuat kapal.','1Dk0lYbBPdXpanWodfrmUDKbNNVsB8ChF','bDmu8-CvBFaHhtBTIQfP1?usp=sharing'),(20,'Salam','Syzygium polyanthum','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Myrtales\nFamili: Myrtaceae\nGenus: Syzygium\nSpecies: Syzygium polyanthum','Pohon berukuran sedang, mencapai tinggi 30 m dan gemang 60 cm. Pepagan (kulit batang) berwarna coklat abu-abu, memecah atau bersisik.\nDaun tunggal terletak berhadapan, dengan tangkai hingga 12 mm. Helai daun berbentuk jorong-lonjong, jorong sempit atau lanset, 5-16 x 2,5–7 cm, gundul, dengan 6-11 urat daun sekunder, dan sejalur urat daun intramarginal tampak jelas dekat tepi helaian, berbintik kelenjar minyak yang sangat halus.\n\n','Karangan bunga berupa malai dengan banyak kuntum bunga, 2–8 cm, muncul di bawah daun atau kadang-kadang pada ketiak. Bunga kecil-kecil, duduk, berbau harum, berbilangan-4; kelopak seperti mangkuk, panjangnya sekitar 4 mm; mahkota lepas-lepas, putih, 2,5-3,5 mm; benang sari banyak, lk. 3 mm, terkumpul dalam 4 kelompok, lekas rontok; piringan tengah agak persegi, jingga kekuningan. Buah buni membulat atau agak tertekan, 12 mm, bermahkota keping kelopak, berwarna merah sampai ungu kehitaman apabila masak.',2.0,NULL,'Daun salam digunakan terutama sebagai rempah pengharum masakan di sejumlah negeri di Asia Tenggara, baik untuk masakan daging, ikan, sayur mayur, maupun nasi.\nKayu yang tergolong ke dalam kayu kelat (nama perdagangan) ini dapat dipergunakan sebagai bahan bangunan dan perabot rumah tangga. \nKulit batang dan daun salam biasa digunakan sebagai bahan ramuan tradisional untuk menyembuhkan sakit perut. Buah salam dimakan orang juga, meski hanya anak-anak yang menyukainya.','15rWVWFcx3F7YI6Azsc2wpRcb_5ne9YKd','Ul7DmXOwNYgFyhHLxHbib?usp=sharing'),(21,'Pulai','Alstonia scholaris','Low risk (Risiko rendah)','Kingdom : Plantae\nDivisi : Tracheophyta\nKelas : Magnoliopsida\nOrdo : Gentianales\nFamili : Apocynaceae\nGenus : Alstonia\nSpesies : Alstonia scholaris','Pohon dengan tinggi 6-10 m dengan diameter batang mencapai 60-100 cm.\nKulit batang berwarna coklat terang dan terdapat getah berwarna putih susu pada bagian dalam kulit kayu. Batang yang sudah tua sangat rapuh dan mudah terkelupas.\nDaun pulai tergolong dalam tipe duduk daun berkarang. Bentuk daun bulat telur seperti spatula dengan ujung daun meruncing. Urat daun sangat jelas menonjol di bagian permukaan bawahnya. Tiap buku-buku batang atau tangkai terdapat 4 – 9 daun.','Bunga pulai tergolong bunga biseksual. Bunga akan mengelompok pada pucuk daun. Perhiasan bunga berwarna putih kehijauan dengan bagian tepi melengkung ke bagian dalam.\nBuah pulai berbentuk memanjang dan ramping. Buah terdiri dari 2 folikel dan buah pulai akan pecah saat kering.',9.0,NULL,'Pohon ini memiliki nama botani Alstonia scholaris. Nama Alstonia merupakan penghormatan kepada Charles Alston, seorang profesor botani di Universitas Edinburgh. Sedangkan nama scholaris diberikan karena pohon ini dimanfaatkan sebagai bahan dasar papan tulis sekolah.','15wkvfVvWpkdRkGOi1nRK7mYb9sU7gBzu','JqmSTDEGDOSKsRqaZVihj?usp=sharing'),(22,'Kepuh','Sterculia foetida','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Malvales\nFamili: Malvaceae\nGenus: Sterculia\nSpesies: Sterculia foetida','Pohon besar yang menggugurkan daun, berumah-dua, tumbuh hingga setinggi 40 m dan gemang batang 3 m. Cabang-cabang tumbuh mendatar dan berkumpul pada ketinggian yang kurang lebih sama, bertingkat-tingkat.\nDaun-daun majemuk menjari, bertangkai 12,5–23 cm, berkumpul di ujung ranting. Anak daun berjumlah 7-9, jorong lonjong dengan ujung dan pangkal meruncing, panjang 10–17 cm.','Bunga majemuk dalam malai dekat ujung ranting, panjang 10–15 cm, hijau atau ungu pudar; dengan kelopak yang berbagi-5 laksana mahkota, taju hingga 1,3 cm, berwarna jingga.\nBuah bumbung besar, lonjong gemuk, 7,6–9 x 5 cm; berkulit tebal, merah terang, akhirnya mengayu; berkumpul dalam karangan berbentuk bintang.\nBiji 10-15 butir per buah, kehitaman, melekat dengan aril berwarna kuning, 1,5–1,8 cm panjangnya.',18.0,NULL,'Nama genusnya diambil dari Sterculius atau Sterquilinus, yakni nama dewa pupuk pada mitologi Romawi. Bersama dengan nama spesiesnya, foetida (artinya, berbau keras, busuk), nama ilmiahnya merujuk pada bau tak enak yang dikeluarkan oleh pohon ini, terutama dari bunganya.','1JtQvt35hjLdUg_24S8NCJwAx5IgeRzPL','NKXavl9nS2BE7vy7I4stZ?usp=sharing'),(23,'Waru','Hibiscus tiliaceus','NatureServe (Aman)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Malvales\nFamili: Malvaceae\nGenus: Hibiscus\nSpesies: Hibiscus tiliaceus','Pohon kecil dengan tinggi 5–15 m. Di tanah yang subur tumbuh lebih lurus dan dengan tajuk yang lebih sempit daripada di tanah gersang.\nDaun bertangkai, bundar atau bundar telur bentuk jantung dengan tepi rata, garis tengah hingga 19 cm; bertulang daun menjari, sebagian tulang daun utama dengan kelenjar pada pangkalnya di sisi bawah daun; sisi bawah berambut abu-abu rapat. Daun penumpu bundar telur memanjang, 2,5 cm, meninggalkan bekas berupa cincin di ujung ranting.\n\n','Bunga berdiri sendiri atau dalam tandan berisi 2–5 kuntum. Daun kelopak tambahan bertaju 8–11, lebih dari separohnya berlekatan. Kelopak sepanjang 2,5 cm, bercangap 5. Daun mahkota bentuk kipas, berkuku pendek dan lebar, 5–7,5 cm, kuning, jingga, dan akhirnya kemerah-merahan, dengan noda ungu pada pangkalnya.\nBuah kotak bentuk telur, berparuh pendek, beruang 5 tak sempurna, membuka dengan 5 katup.[3] Bijinya kecil, dan berwarna coklat muda.\nAkar waru berbentuk tunggang dan berwarna putih kekuningan.',9.0,NULL,'Legenda masyarakat penghuni Pulau Jawa menyatakan, kuntilanak menyukai pohon waru yang tumbuh miring (waru doyong) sebagai tempat bersemayamnya.','1dqp0TUYtnEysNlFG8DZR4nriFIqxViMC','J8HpF9ibkZRGdrud7Cil8?usp=sharing'),(24,'Kenari','Canarium indicum','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Burseraceae\nGenus:Canarium\nSpesies:Canarium indicum','Pohon dengan batang bergalur , berbantalan , cabang lateral yang berat dan kanopi yang lebat. Pohon dewasa biasanya setinggi 20-30 m (70-100 kaki), tetapi dapat tumbuh hingga 40 m (130 kaki). Mereka secara alami tumbuh dengan kepadatan antara 200 dan 300 kg/m3. Batang diameter antara 1-1,5 m (3,3-4,9 ft) dan dapat mencapai 30 m (100 ft) dengan diameter tajuk.\nDaun berwarna hijau terang imparipinnate dengan 3 sampai 7 jugate . Memiliki selebaran oblong-obovate hingga oblong- lanset 7–28 cm (2,8-11,0 in) kali 3,5-11 cm (1,4-4,3 in). Tumpul tajam dengan sub- undulasi dan memiliki seluruh tepi. Pseudostipules (besar, berdaun, bulat telur dan bergerigi-dentate dengan tepi berpohon).','Bunga canarium berukuran kecil, berdiameter sekitar 1 cm (0,4 inci), putih kekuningan dan muncul di malai terminal , dengan stipula dan bract gugur di dasar bunga. Selain itu, bunga perianth trimerous dengan permukaan luar puber dan mengandung 6 benang sari bergabung, bebas dari perianth . Ovarium lebih unggul dan memiliki tiga loculed dengan satu gaya. Canarium memiliki infructescence besar dengan hingga 30 buah ditanggung pada tangkai terjumbai . \nBuahnya bulat telur hingga elips-lonjong. Berukuran 3–6 cm (1,2–2,4 inci) kali 2-3 cm (0,79–1,18 inci), umumnya memiliki warna hijau dan berubah menjadi gelap pekat, hitam atau biru-hitam saat matang.',13.0,NULL,'Batangnya mengeluarkan resin yang diperdagangkan untuk campuran vernis dan melicinkan perahu. Resin ini juga dapat digunakan sebagai balsem.','1vp-7b4gpXsVg8nI7XXJgs2R2_3L4ywui','30IGwFhsTor-1QaJQXhRl?usp=sharing'),(25,'Hantap','Sterculia oblongata','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta \nKelas: Magnoliopsida\nOrdo: Malvales\nFamili: Malvaceae\nGenus: Sterculia\nSpesies: Sterculia oblongata','Daun tunggal yang lebar tersusun secara spiral.','Buah berwarna merah dengan biji hitam di dalamnya. Bunga tersusun secara berkelompok.',4.0,NULL,'Perasan daun hantap memiliki khasiat mengobati panas dalam. Selain panas dalam, daun hantap juga berkhasiat untuk sariawan, mengatasi perut kembung, melancarkan buang air besar, dan melancarkan persalinan.','10LddoU90msnjh1xUoqGV8c7oI0FWvLsJ','XGyPb6WcWi8PbaA7Wi1Bi?usp=sharing'),(26,'Sobsi','Maesopsis eminii','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta \nKelas: Magnoliopsida\nOrdo: Rosales\nFamily: Rhamnaceae\nGenus: Maesopsis\nSpecies: Maesopsis eminii','Maesopsis eminii adalah pohon semi-gugur besar yang tumbuh cepat dengan ketinggian sekitar 30 m (100 kaki). Batangnya lurus dengan batang yang jelas untuk sepertiga terbawah. Kulit batangnya berwarna coklat keabu-abuan dan berkerut dalam. Cabang-cabangnya sebagian besar horizontal menyebabkan tajuk menjadi rata, meskipun menjadi lebih bulat seiring bertambahnya usia pohon.\nDaunnya sederhana dan berbentuk elips-lanset, dengan tepi bergigi, 6 cm hingga 15 cm × 2 cm hingga 5 cm (2,4 inci hingga 5,9 inci × 0,8 inci hingga 2,0 inci), mengkilap di atasnya, dengan kelenjar di setiap gigi. Pada bagian bawah daun terdapat domatia pada ketiak saraf sekunder.','Perbungaannya adalah cyme berbunga banyakhingga 5 cm (2 inci), setiap bunga kuning kehijauan memiliki lima lobus kelopak yang lebih panjang dari lobus mahkota dan satu kepala sari. Buahnya adalah buah berbiji hingga 3,5 cm (1,4 inci), hijau pada awalnya, berubah menjadi kuning dan kemudian ungu-hitam saat matang. Ini berisi batu besar dengan satu atau dua biji hitam di dalamnya.',10.0,NULL,'Ini adalah satu-satunya spesies dalam genus Maesopsis . Sering ditanam sebagai pohon perkebunan, dan sebagai pohon peneduh diperkebunan kopi dan tanaman lainnya. Burung dan monyet dapat menyebarkan benih. Karena pohon ini tumbuh cepat, pohon ini sering digunakan untuk regenerasi lahan hutan yang rusak. Kayunya digunakan untuk konstruksi dan kayu bakar dan daunnya untuk pakan ternak .','1beasjlwflA9ErlhOtQe1EsSWckilITYx','43XAM5TLZBZQY-L2e6fdS?usp=sharing'),(27,'Angsana','Pterocarpus indicus','Vulnerable (Rentan)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Fabales\nFamili: Fabaceae\nGenus: Pterocarpus\nSpesies: Pterocarpus indicus','Tinggi hingga 40m dan gemang mencapai 350cm. Batang sering beralur atau berbonggol; biasanya dengan akar papan (banir). Tajuk lebat serupa kubah, dengan cabang-cabang yang merunduk hingga dekat tanah. Pepagan (kulit kayu) abu-abu kecoklatan, memecah atau serupa sisik halus, mengeluarkan getah bening kemerahan apabila dilukai.\nDaun majemuk menyirip gasal, panjang 12–30 cm. Anak daun 5-13, berseling pada poros daun, bundar telur hingga agak jorong, 6-10 × 4–5 cm, dengan pangkal bundar dan ujung meruncing, hijau terang, gundul, dan tipis.','Bunga-bunga berkumpul dalam malai di ketiak, panjangnya 9–15 cm. Bunga berkelamin ganda, berwarna kuning dan berbau harum semerbak, berbilangan-5. Kelopak serupa lonceng, berdiameter 6mm, dua taju teratas lebih besar dan kadang-kadang menyatu. Mahkota lepas-lepas, berkuku, bendera bundar telur terbalik atau seperti sudip. Benang sari 10 helai, yang teratas lepas atau bersatu.\nBuah polong bundar pipih, dikelilingi sayap tipis seperti kertas. Diameternya 6 cm, tidak memecah ketika masak. Biji 1-4 butir. Polong akan masak dalam waktu 4-6 bulan, berwarna kecoklatan ketika mengering. Bagian tengah polong gundul pada forma indicus dan berbulu sikat.',6.0,NULL,'Angsana adalah pohon identitas nasional Filipina; juga merupakan pohon identitas provinsi-provinsi Chonburi dan Phuket di Thailand.\nKarena kuat dan awet serta tahan cuaca, kayu angsana digunakan dalam konstruksi ringan maupun berat seperti rangka bangunan, penutup dinding, tiang, pilar, jembatan, bantalan rel kereta api, kayu-kayu penyangga, konstruksi perairan bahari, dan lain-lain dalam bentuk balok, kasau, papan, dan panil kayu yang lain.\nAngsana termasuk jenis kayu populer sebagai bahan sarung keris (warangka), terutama karena adanya pola totol-totol atau garis dan urat-urat kayunya dekoratif.','16B3MeSV5QbunGae9dlMoPJZAHRBZ2vbj','7yzr3uQtDEbnpczcoXoc_?usp=sharing'),(28,'Limus','Mangifera foetida','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Anacardiaceae\nGenus: Mangifera\nSpesies: Mangifera foetida','Pohon besar berbatang lurus, dapat mencapai 30-35 m. Kulit kayunya coklat sampai coklat kelabu tua, memecah beralur dangkal. Bila dilukai (semua bagian tanaman) mengeluarkan getah bening kelabu keputihan, yang lama-lama menjadi kemerahan dan menghitam. Getah ini tajam, gatal dan dapat melukai kulit (terutama selaput lendir). Tidak memiliki banir (akar papan).\nDaun agak kaku dan serupa kulit, bertangkai kaku panjangnya 1,5 – 8 cm, lembar daun kurang lebih berbentuk jorong memanjang, 9-15 × 15–40 cm, gundul dan hijau tua.','Perbungaan dalam malai agak di ujung, tegak bercabang-cabang, seperti piramida, panjangnya 10–40 cm, merah tua sampai merah tembaga dan berbau harum. Bunga lebat kecil-kecil, berbilangan 5; kelopak 4–5 mm, bundar telur terbalik; mahkota 6–9 mm, lanset menyempit, merah jambu sampai kuning pucat di ujung.\nBuah batu lonjong bulat telur atau hampir bulat, 7-12 × 9–16 cm, berkulit tebal dan gundul, hijau sampai kekuning-kuningan, kusam, dengan bintik-bintik lentisel yang berwarna kecoklatan. Daging buah jika masak berwarna kuning-jingga pucat sampai kuning, berserat, asam manis rasanya dan banyak mengandung sari buah, harum menyengat agak seperti terpentin.',6.0,NULL,'Termasuk jenis endemik Kalimantan.\nDaunnya dapat digunakan sebagai penurun demam, dan bijinya untuk mengobati penyakit jamur, kudis dan eksem. Getahnya untuk memperdalam gambar tato tradisional.\nDalam 100 gram, bacang yang sudah matang mengandung kalori 98 gram, protein 1,4%, lemaknya cukup sedikit, yakni 0,2 %. Air yang terkandung juga cukup banyak, yakni 72,5%. Bagi orang yang ingin langsing/kurus, bisa menjadikan bacang sebagai menu diet-nya.','1twF3r--PmrC-fXtOb3UwHLHdd_afUF14','khqHDqIvpJYXZOLwF8Grl?usp=sharing'),(29,'Jaha','Terminalia bellirica','Not extinct (Tidak punah) ','Kingdom: Plantae\r\nDivisi: Magnoliophyta\r\nKelas: Magnoliopsida\r\nOrdo: Myrtales\r\nFamily: Combretaceae\r\nGenus: Terminalia\r\nSpecies: Terminalia bellirica','Pohon dapat mencapai tinggi 50 m dan diameter 3 m. Batang yang sering ditopang pada dasarnya adalah tanpa cabang hingga 20 m. Kulit kayunya berwarna kebiruan atau abu-abu keabu-abuan yang ditutupi dengan banyak retakan memanjang halus, kulit bagian dalam berwarna kekuningan. Daun besar, gundul, bergantian, elips lebar hingga lonjong-elips, 4-24 cm x 2-11 cm, pangkal membulat hingga runcing, kasar-serius tetapi segera gundul, dengan 6-9 pasang vena sekunder. Sekunder dan tersier venasi menonjol di kedua permukaan, berkerumun ke arah ujung cabang kecil. Panjang tangkai daun 2,5-9 cm. Daun muda berwarna merah tembaga, segera menjadi hijau nuri, lalu hijau tua.','Bunga soliter, kecil, panjang 3-15 cm, putih kehijauan, sederhana, ketiak daun sepatu berduri; tabung kelopak padat sericeous atau tomentulose; bunga muncul bersama dengan daun baru dan memiliki bau seperti madu yang kuat. Buah sub-globular sampai ellipsoid lebar, 2-4 x 1,8-2,2 cm, velutinous padat atau sericeous, kuning muda, samar-samar bersudut 5 dan berwarna coklat tomentosa.',5.0,NULL,'Nama genus \'Terminalia\' berasal dari kata Latin \'terminus\' atau \'terminalis\' (akhir), dan mengacu pada  dedaunan yang bergerombol atau ditanggung di ujung pucuk.','1bMnhQGYKOnVe2gQFCHMd8aOaVe6w3Xa4','1MiYXzFL9codz7q232Px37-MDCytpqyeJ?usp=sharing'),(30,'Sawo','Manilkara zapota','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Ericales\nFamili: Sapotaceae\nGenus: Manilkara\nSpesies: Manilkara zapota','Dapat tumbuh hingga setinggi 30-40 m. Bercabang rendah, batang sawo manila berkulit kasar abu-abu kehitaman sampai cokelat tua. Seluruh bagiannya mengandung lateks, getah berwarna putih susu yang kental.\nDaun tunggal, terletak berseling, sering mengumpul pada ujung ranting. Helai daun bertepi rata, sedikit berbulu, hijau tua mengilap, bentuk bundar-telur jorong sampai agak lanset, 1,5-7 x 3,5-15 cm, pangkal dan ujungnya berbentuk baji, bertangkai 1-3,5 cm, tulang daun utama menonjol di sisi sebelah bawah.','Bunga-bunga tunggal terletak di ketiak daun dekat ujung ranting, bertangkai 1–2 cm, kerap kali menggantung, diameter bunga s/d 1,5 cm, sisi luarnya berbulu kecokelatan, berbilangan 6. Kelopak biasanya tersusun dalam dua lingkaran; mahkota bentuk genta, putih, berbagi sampai setengah panjang tabung.\nBuah buni bertangkai pendek, bulat, bulat telur atau jorong, 3-6 x 3–8 cm, cokelat kemerahan sampai kekuningan di luarnya dengan sisik-sisik kasar cokelat yang mudah mengelupas, sering dengan sisa tangkai putik yang mengering di ujungnya. Berkulit tipis, dengan daging buah yang lembut dan kadang-kadang memasir, cokelat kemerahan sampai kekuningan, manis dan mengandung banyak sari buah. Berbiji sampai 12 butir, namun kebanyakan kurang dari 6, lonjong pipih, hitam atau kecokelatan mengilap, panjang 2 cm, keping biji berwarna putih lilin.',3.0,NULL,'Kebanyakan buah sawo manila dimakan dalam keadaan segar sebagai buah meja. Akan tetapi sawo dapat pula diolah menjadi serbat (sherbet), dicampurkan ke dalam es krim, atau dijadikan selai. Sari buah sawo dapat dipekatkan menjadi sirup, atau difermentasi menjadi anggur atau cuka. Getahnya dapat dijadikan lem ataupun pernis.\nKayu sawo memiliki keawetan yang baik, tahan terhadap serangan jamur dan serangga. Kayu ini juga merupakan favorit anak-anak di Jawa untuk membuat gasing.','16mCqby7JQMX6uh4_1ubGtNYFW9BsB5Eg','jRWMJI1UYPVYtFU9DhLUM?usp=sharing'),(31,'Jenitri','Elaeocarpus sphaericus','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Oxalidales\nFamili: Elaeocarpaceae\nGenus: Elaeocarpaceae\nSpesies: Elaeocarpaceae sphaericus','Pohon dapat mencapai dapat mencapai 25-30 meter (di India) dengan batang tegak dan bulat berwarna cokelat. Sepanjang tepi daunnya bergerigi dan meruncing di bagian ujung. Umur 4 tahun mencapai tinggi 4 meter.\nDaun lanset, tangkai 2-12 mm; pangkal helaian beralih demi sedikit menjadi tangkai, 6-18 x 2-6 cm, akhirnya gundul, seperti kulit, bergerigi beringgit tidak dalam, berbintik hitam, 10-15 tulang daun samping pada kedua belah sisi dari tulang daun utama.','Tangkai bunga ±0,5 cm; daun kelopak bulat telur memanjang, runcing, hijau pucat atau kemerahan, dari luar berambut; daun mahkota kuning atau putih kehijauan, ke atas tidak melebar, panjang ±1,3 cm. Tonjolan dasar bunga berambut kasar, bakal buah bentuk telur, berambut rapat; kepala putik tidak melebar.\nBuah berbentuk bola, boleh dikatakan gundul, warna biru tua, diameter ±0,5 cm sd 2 cm. Biji-biji ganitri keras dan awet (bisa bertahan 8 generasi)',11.0,NULL,'Bijinya dipakai untuk membuat rantai, kalung, buah baju, dsb','16MkXNlL5mTv5t3iaJtQaAeF4ERk8K3pa','muOdPZFo4qRAklyNwnIJ3?usp=sharing'),(32,'Huru Leueur','Sterculia cordata','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Malvales\nFamili: Malvaceae\nGenus: Sterculia\nSpesies: Sterculia cordata','Sterculia cordata adalah pohon setinggi hingga 40 m..\nDaun tersusun secara spiral dan mengelompok ke arah ujung ranting. Daunnya bulat telur sampai elips-lonjong (panjang 13 – 22 cm dan lebar 8 – 11 cm), dengan pangkal berbentuk hati. Permukaan atas sebagian besar halus kecuali midvein sementara permukaan bawah tertutup rapat dengan rambut bintang, yang mengering oranye. Tangkai daun memiliki panjang 2 – 5 cm dan kedua ujungnya sedikit menebal. Stipula rontok lebih awal dan tertutup rapat oleh rambut bintang.','Bunganya berwarna merah muda, berbentuk lonceng (panjang 2 – 3 mm) dan dalam kelompok yang terkulai. \nBuah terjadi dalam kelompok 1-5 folikel kayu yang terjumbai yang berubah menjadi merah saat matang. \n',6.0,NULL,'Cordatus, berarti berbentuk hati, mengacu pada pangkal daun. \nTanamn ini dapat digunakan untuk obat muntah darah, TBC dan sesak nafas.','1pp9Pl1GMYCvO_F5r1auxFthi6n_WgDCr','HUojyvQDvKVoHfHm_p_JO?usp=sharing'),(33,'Nangka','Artocarpus heterophyllus','Not extinct (Tidak punah) ','Kingdom: Plantae\r\nDivisi: Magnoliophyta\r\nKelas: Magnoliopsida\r\nOrdo: Rosales\r\nFamili: Moraceae\r\nGenus: Artocarpus\r\nSpesies: Artocarpus heterophyllus','Pohon nangka umumnya berukuran sedang, sampai sekitar 20 m tingginya, walaupun ada yang mencapai 30 meter. Batang bulat silindris, sampai berdiameter sekitar 1 meter. Tajuknya padat dan lebat, melebar dan membulat apabila di tempat terbuka. Seluruh bagian tumbuhan mengeluarkan getah putih pekat apabila dilukai. Daun tunggal, tersebar, bertangkai 1–4 cm, helai daun agak tebal seperti kulit, kaku, bertepi rata, bulat telur terbalik sampai jorong (memanjang), 3,5-12 × 5–25 cm, dengan pangkal menyempit sedikit demi sedikit, dan ujung pendek runcing atau agak runcing. Daun penumpu bulat telur lancip, panjang sampai 8 cm, mudah rontok dan meninggalkan bekas serupa cincin.','Tumbuhan nangka berumah satu (monoecious), perbungaan muncul pada ketiak daun pada pucuk yang pendek dan khusus, yang tumbuh pada sisi batang atau cabang tua. Bunga jantan dalam bongkol berbentuk gada atau gelendong, 1-3 × 3–8 cm, dengan cincin berdaging yang jelas di pangkal bongkol, hijau tua, dengan serbuk sari kekuningan dan berbau harum samar apabila masak. Bunga nangka disebut babal. Setelah melewati umur masaknya, babal akan membusuk (ditumbuhi kapang) dan menghitam semasa masih di pohon, sebelum akhirnya terjatuh. Bunga betina dalam bongkol tunggal atau berpasangan, silindris atau lonjong, hijau tua. Buah majemuk (syncarp) berbentuk gelendong memanjang, sering kali tidak merata, panjangnya hingga 100 cm, pada sisi luar membentuk duri pendek lunak. \'Daging buah\', yang sesungguhnya adalah perkembangan dari tenda bunga, berwarna kuning keemasan apabila masak, berbau harum-manis yang keras, berdaging, kadang-kadang berisi cairan (nektar) yang manis. Biji berbentuk bulat lonjong sampai jorong agak gepeng, panjang 2–4 cm, berturut-turut tertutup oleh kulit biji yang tipis cokelat seperti kulit, endokarp yang liat keras keputihan, dan eksokarp yang lunak. Keping bijinya tidak setangkup.',3.0,NULL,'Kayunya  menghasilkan bahan pewarna kuning untuk mewarnai jubah para pendeta Buddha. Kulit batangnya yang berserat, dapat digunakan sebagai bahan tali dan pada masa lalu juga dijadikan bahan pakaian. Getahnya digunakan dalam campuran untuk memerangkap burung, untuk memakal (menambal) perahu dan lain-lain.','18MqDMeufcqjG-7VEGzcltEv5bQChWHqf',NULL),(34,'Mangga','Mangifera indica','Data deficient (Data kurang)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Anacardiaceae\nGenus: Mangifera\nSpesies: Mangifera indica','Dapat mencapai tinggi hingga 30 m atau lebih, meski kebanyakan mangga pekarangan hanya sekitar 15 m atau kurang. Batang tegak, bercabang kuat; dengan daun-daun lebat membentuk tajuk yang indah berbentuk kubah, oval atau memanjang, dengan diameter sampai 10 m. Kulit batangnya tebal dan kasar dengan banyak celah-celah kecil dan sisik-sisik bekas tangkai daun. Warna pepagan (kulit batang) yang sudah tua biasanya coklat keabuan, kelabu tua sampai hampir hitam.\nMangga berakar tunggang yang bercabang-cabang, sangat panjang hingga bisa mencapai 6 m. Akar cabang makin ke bawah semakin sedikit, paling banyak akar cabang pada kedalaman lebih kurang 30–60 cm.\nDaun tunggal dan dengan letak tersebar. Panjang tangkai daun bervariasi dari 1,25-12,5 cm, bagian pangkalnya membesar dan pada sisi sebelah atas ada alurnya. Aturan letak daun pada batang biasanya 3/8, tetapi semakin mendekati ujung, letaknya semakin berdekatan sehingga tampaknya seperti dalam lingkaran (roset). Helai daun bervariasi namun kebanyakan berbentuk jorong sampai lanset, dengan panjang sekitar 15-40 cm dan lebarnya 6-16 cm, agak liat dan kasar seperti kulit, daun muda berwarna merah pulasan sampai kejinggaan, dan akan berangsur-angsur menjadi hijau tua mengkilap, dengan umur daun bisa mencapai 1 tahun atau lebih. Daunnya berpangkal melancip dengan tepi daun bergelombang dan ujung meluncip, dengan 12-30 tulang daun sekunder.','Berumah satu (monoecious), bunga mangga merupakan bunga majemuk yang berkarang dalam malai bercabang banyak di ujung ranting. Karangan bunga biasanya berbulu, tetapi sebagian ada juga yang gundul, kuning kehijauan, sampai 40 cm panjangnya. Bunga majemuk ini terdiri dari sumbu utama yang mempunyai banyak cabang utama. Setiap cabang utama ini mempunyai banyak cabang-cabang, yakni cabang kedua. Ada kemungkinan cabang bunga kedua ini mempunyai suatu kelompok yang terdiri dari 3 bunga atau mempunyai cabang tiga. Setiap kelompok tiga bunga terdiri dari tiga kuntum bunga dan setiap kuntum bertangkai pendek dengan daun kecil. Jumlah bunga pada setiap bunga majemuk bisa mencapai 1000-6000. Bunga berkelamin campuran, ada yang jantan dan ada pula yang hermafrodit (berkelamin dua). Besarnya bunga lebih kurang 6–8 mm. Bunga jantan lebih banyak daripada bunga hermafrodit, dan jumlah bunga hermafrodit inilah yang menentukan terbentuknya buah. Bunga mangga biasanya bertangkai pendek, jarang sekali yang bertangkai panjang, dan berbau harum. Kelopak bunga biasanya bertaju 5; demikian juga mahkota bunga terdiri dari 5 daun bunga, tetapi kadang-kadang ada yang 4 sampai 8. Warnanya kuning pucat, sedangkan pada bagian tengah terdapat garis timbul berjumlah 3 sampai 5 yang warnanya sedikit tua. Bagian tepi daun mahkota berwarna putih. Pada waktu akan layu, warna mahkota bunga tadi menjadi kemerahan.\nBuah mangga termasuk kelompok buah batu (drupa) yang berdaging, dengan ukuran dan bentuk yang sangat berubah-ubah bergantung pada macamnya, mulai dari bulat (misalnya mangga gedong), bulat telur (gadung, indramayu, arumanis) hingga lonjong memanjang (mangga golek). Panjang buah kira-kira 2,5–30 cm. Kulit buah agak tebal berbintik-bintik kelenjar; hijau, kekuningan atau kemerahan bila masak. Daging buah jika masak berwarna merah jingga, kuning atau krem, berserabut atau tidak, manis sampai masam dengan banyak air dan berbau kuat sampai lemah. Biji berwarna putih, gepeng memanjang tertutup endokarp yang tebal, mengayu dan berserat. Biji ini terdiri dari dua keping.',9.0,NULL,'Mangga memiliki nilai-nilai kultural yang tinggi, khususnya di berbagai negara di Asia bagian selatan. Di Filipina, buah ini merupakan simbol nasional. Dalam kitab suci Weda agama Hindu, mangga dianggap sebagai “hidangan para dewa”. Daun-daun mangga kerap digunakan secara ritual dalam dekorasi upacara perkawinan atau keagamaan Hindu.','1B9yePDYOrwg8Zq1RT4SVTeb4cinxd-bB','yHU0_SckDtM5Qyexzha9J?usp=sharing'),(35,'Campoleh','Pouteria campechiana','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Ericales\nFamily: Sapotaceae\nGenus: Pouteria\nSpecies: Pouteria campechiana','Pohon sawo mentega berukuran sedang, tinggi hingga 30 m; meski kebanyakan hanya mencapai 20 m. Pepagannya berwarna kelabu tua, berusuk halus, mengeluarkan getah susu (lateks) apabila dilukai.\nDaun-daun terkumpul di ujung ranting, bundar telur terbalik dan memanjang, agak menyerupai sudip, 6–25 × 2,5–8 cm, meruncing di pangkal dan ujungnya, berwarna hijau berkilap; bertangkai 5–25 cm. Bunga muncul di ketiak daun bagian bawah, tunggal atau mengelompok, bertangkai panjang 5–12 cm, berbilangan-5, hijau keputih-putihan, berbau harum.','Buah buni berbentuk gelendong, bulat telur, bulat telur sungsang, sampai membulat, dengan ujung berparuh, 7,5–12,5 × 2–7,5 cm, berkulit tipis, licin seperti berlilin, kaku, kuning bila masak. Daging buah berwarna kuning, lembap atau agak kering menepung, berbau harum agak samar, manis. Biji besar, coklat mengilat, bentuk bulat telur, panjangnya hingga 5 cm, 1–5 butir dalam tiap buah.',5.0,NULL,'Kayunya yang berwarna coklat keabu-abuan hingga kemerah-merahan bertekstur halus, kuat, keras, dan berbobot sedang hingga berat; baik untuk membuat papan atau balok. Di Amerika Tengah, lateksnya disadap untuk campuran getah sawo manila, dijadikan bahan permen karet.','19mY2X09BuP0J1EzOxhaVSSi58bDnBAts','6CYExUrA3AE1mshrIriBA?usp=sharing'),(36,'Malaka','Phyllanthus emblica','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Malpighiales\nFamily: Phyllanthaceae\nGenus: Phyllanthus\nSpecies: Phyllanthus emblica','Pohonnya berukuran kecil hingga sedang, tingginya mencapai 1–8 m (3 kaki 3 inci–26 kaki 3 inci). Anak cabang tidak gundul atau puber halus, panjang 10–20 cm (3,9–7,9 inci), biasanya gugur; daunnya sederhana, subsessile dan tersusun rapat di sepanjang cabang, hijau muda, menyerupai daun menyirip.','Bunganya berwarna kuning kehijauan. Buahnya hampir bulat, kuning kehijauan muda, agak halus dan keras pada penampilan, dengan enam garis vertikal atau alur.',9.0,NULL,'Di daerah Batak di Sumatera , Indonesia, kulit bagian dalam digunakan untuk memberikan rasa pahit dan astringen pada kaldu sup ikan tradisional yang dikenal sebagai holat .','1Yl8LZflv8bv-AS_VqGBl7DHpgLk5jsmZ','e7WyNH3KGKtyLlxhqwkXq?usp=sharing'),(37,'Sawo Apel','Chrysophyllum cainito','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Ericales\nFamili: Sapotaceae\nGenus: Chrysophyllum\nSpesies: Chrysophyllum cainito','Pohon yang selalu hijau dan tumbuh cepat, tinggi hingga 30 m, dengan batang berkayu, silindris, tegak, pepagan berpermukaan kasar berwarna cokelat, abu-abu gelap sampai keputihan; dengan banyak bagian pohon yang mengeluarkan lateks—getah putih yang pekat—manakala dilukai.\nDaun tunggal berwarna coklat-keemasan (chrysophyllum berarti daun yang berwarna keemasan), karena bulu-bulu halus yang tumbuh terutama di sisi bawah daun dan di rerantingan; permukaan atasnya lekas gundul dan berwarna hijau cerah. Duduk daun berseling, memencar, bentuk lonjong sampai bundar telur terbalik, 3-6 x 5-16 cm, seperti kulit, bertangkai 0,6-1,7 cm panjangnya.','Perbungaan terletak di ketiak daun, berupa kelompok 5-35 kuntum bunga kecil-kecil bertangkai panjang, kekuningan sampai putih lembayung, harum manis. Kelopak 5 helai, bundar sampai bundar telur; mahkota bentuk tabung bercuping 5, bundar telur, panjang sampai 4 mm.\nBuah buni berbentuk bulat hingga bulat telur sungsang, berdiameter 5–10 cm, dengan kulit buah licin mengkilap, coklat keunguan atau hijau kekuningan sampai keputihan. Kulit agak tebal, liat, banyak mengandung lateks dan tak dapat dimakan. Daging buah putih atau keunguan, lembut dan banyak mengandung sari buah, manis, membungkus endokarp berwarna putih yang terdiri dari 4-11 ruang yang bentuknya mirip bintang jika dipotong melintang. Biji 3-10 butir, pipih agak bulat telur, coklat muda sampai hitam keunguan, keras berkilap.',1.0,NULL,'Sawo apel umumnya dikonsumsi sebagai buah segar, meski juga dapat digunakan sebagai bahan baku es krim atau serbat (sherbet). Pohon sawo apel menghasilkan buah setelah berumur 5-6 tahun, dan biasanya musim puncak buah itu di Jawa terjadi pada musim kemarau.\nBanyak bagian pohon yang berkhasiat obat; misalnya kulit kayunya, getah, buah dan biji. Rebusan daunnya dipakai untuk menyembuhkan diabetes dan rematik. Dari pepagannya (kulit kayu) dihasilkan obat kuat dan obat batuk.\nPohonnya kerap digunakan sebagai tanaman hias dan peneduh di taman-taman dan tepi jalan. Kayunya cukup baik sebagai bahan bangunan. Dan cabang-cabangnya yang tua dimanfaatkan untuk menumbuhkan anggrek.','1YiKTEY4onIpxZ-UIju2TgarxGwZeKpP5','CYExUrA3AE1mshrIriBA?usp=sharingg'),(38,'Kisampang','Euodia glabra','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Sapindales\nFamily: Rutaceae\nGenus: Euodia\nSpecies: Euodia glabra','Euodia glabra tumbuh setinggi 40 meter (130 kaki). Daunnya masing-masing memiliki 3 helai daun, panjangnya bulat telur 10-16 sentimeter. ','Buahnya bulat hingga elips dan panjangnya mencapai 0,4 cm (0,2 inci).\nBunganya masing-masing memiliki 4-5 benang sari dalam malai besar.',15.0,NULL,'Ki Sampang merupakan tanaman perdu yang banyak tumbuh di Indonesia dan jarang dilirik masyarakat karena merupakan tanaman. Namun ternyata, berdasarkan penelitian bahwa tanaman ini memiliki kandungan senyawa untuk kanker rahim.','1gzyZf0prAOu5bqFML65mSZTopgsFxTvB','DASY2uLa8KnnEvxV5LlQ0?usp=sharing'),(39,'Tusam','Pinus merkusii','Vulnerable (Rentan)','Kingdom: Plantae\nDivision: Pinophyta\nKelas: Pinopsida\nOrdo: Pinales\nFamily: Pinaceae\nGenus: Pinus\nSpecies: Pinus merkusii','Pinus merkusii adalah pohon berukuran sedang hingga besar , tingginya mencapai 25–45 meter (82–148 kaki) dan dengan diameter batang hingga 1 meter (3,3 kaki). Kulit batangnya berwarna oranye-merah, tebal dan pecah-pecah di dasar batang, dan tipis dan bersisik di mahkota atas.\nDaun ( \"jarum\") yang berpasangan, sangat ramping, 15-20 cm panjang dan kurang dari 1 mm tebal, hijau hingga hijau kekuningan.\n\n','Biji berbentuk kerucut, 5-8 cm panjang dan 2 cm lebar di dasar ketika ditutup, hijau pada awalnya, pematangan mengkilap merah-coklat. Terbuka hingga lebar 4-5 cm pada saat dewasa untuk melepaskan benih. Bijinya memiliki panjang 5–6 mm, dengan sayap 15-20 mm, dan tersebar oleh angin.',1.0,NULL,'Perum Perhutani membudidayakan tusam di sejumlah tempat di Jawa dan Sumatra untuk disadap getah batangnya, sebagai bahan baku terpentin dan gondorukem.','1STQ3LtQKT8O4HxSv8oBU2rdMuNzMm_Oz','itJtxIsmE4HZLLkE1XkzT?usp=sharing'),(40,'Gandaria','Bouea gandaria','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Sapindales\nFamili: Anacardiaceae\nGenus: Bouea\nSpesies: Bouea macrophylla','Tinggi tanaman gandaria bisa mencapai 27 m dengan diameter 55 cm. Kanopi tanaman berbentuk kerucut atau bundaran dengan daun yang lebat sehingga sangat cocok dipakai sebagai tanaman peneduh.\nDaun berbentuk lanset sampai elip, daun berukuran besar dengan panjang daun 13-35 cm dan lebar 5-7 cm.','Buah berwarna hijau pada saat muda dan kuning oranye ketika matang, dan rasa dari asam sampai manis. Panjang buah 3-6 cm dengan lebar 3-4 cm. Biji berukuran diameter 2-5 cm dengan kotiledon berwarna ungu terang. Tanaman jika ditanam dari biji akan mulai berbuah pada umur 6-8 tahun, sementara jika dari sambungan akan menghasilkan 4-5 tahun kemudian.',2.0,NULL,'Buah muda biasanya dipakai sebagai sambal, rujak atau asinan, daun muda dipakai sebagai lalapan, sementara buah matang dapat langsung dimakan dengan mengelupas kulitnya atau dipakai sebagai manisan ataupun jus dengan rasa asam manis yang sangat menyegarkan. Potensi lain adalah sebagai bahan sirup dan selai.','1Jo63Jobq2OFM3qiQOufLuoZKxcZ1RRuE',''),(41,'Tisuk','Hibiscus macrophylla','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Malvales\nFamili: Malvaceae\nGenus: Hibiscus\nSpesies: Hibiscus macrophyllus','Tisuk tumbuh tinggi, hingga 25 m, tetapi dengan batang dan tajuk yang kurus; agak-agak mirip dengan payung. Gemang batangnya 15–25 cm. \nKuncup terletak terminal, 7–9 cm, terlindung oleh daun penumpu yang lebar memanjang. Daunnya tunggal, bundar, ujungnya lancip, ukurannya besar, berbulu halus, bertangkai panjang, 15–30 cm. Helai daun hampir bundar, bentuk jantung, garis tengah 20–36 cm; bertepi rata atau bergerigi; dengan 7–9 ibu tulang daun yang menjari. Kuncup daun, ranting, tangkai daun, berwarna coklat kekuningan.','Bunga dalam karangan terminal bentuk payung, hingga 30 cm. Daun kelopak tambahan bertaju 10–12, hampir sama panjang dengan kelopak yang bertaju 5. Mahkota berdiameter lk. 6 cm, kuning dengan warna ungu di tengahnya. Tangkai benang sari lk. 3 cm.\nBuah kotak panjang 2,5–3 cm, berbulu halus rapat',20.0,NULL,'Di Jawa, kayu tisuk dimanfaatkan untuk rumah dan bangunan lain.','1gJAlzv2AXycdm_7bsqBFHlkp1NQ5w9CR','F3BN1AVXRbuKlI4RDgPFY?usp=sharing'),(42,'Beringin','Ficus benjamina','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Rosales\nFamily: Moraceae\nGenus: Ficus\nSpecies: Ficus benjamina','Ficus benjamina adalah pohon yang tingginya mencapai 30 m (98 kaki) dalam kondisi alami, dengan cabang yang terkulai anggun dan daun mengkilap 6–13 cm, oval dengan acuminate tip. Kulit batang berwarna abu-abu dan halus. Kulit cabang muda berwarna kecoklatan. Puncak pohon yang tersebar luas dan bercabang sering kali berdiameter 10 meter.\nBerdaun relatif kecil. Daun yang dapat diganti sederhana, utuh dan bertangkai. Tangkai daun panjangnya 1-2,5 cm. Daun muda berwarna hijau muda dan sedikit bergelombang, daun tua berwarna hijau dan halus; yang helai daun adalah bulat telur untuk ovate- lansetdengan dasar berbentuk baji hingga membulat lebar dan diakhiri dengan ujung penetes pendek. Helaian daun pucat mengkilap hingga kusam berukuran 5 hingga 12 cm panjang dan 2 sampai 6 cm lebar. Di dekat tepi daun terdapat sel kristal kuning (\"cystolite\"). Kedua membran, daun stipula tidak menyatu, lanset dan panjangnya 6 sampai 12 mm.\n','Ficus benjamina adalah berumah satu . Inflorescences yang bulat untuk berbentuk telur, hijau mengkilap, dan memiliki diameter 1,5 cm. Dalam perbungaan ada tiga jenis bunga: jantan dan bunga betina subur dan mandul . Bunga jantan tersebar, perbungaan, bertangkai, memiliki sepal bebas dan benang sari . Banyak bunga betina yang subur adalah sessile dan memiliki tiga atau empat sepal dan ovarium berbentuk telur. Gaya lateral yang kurang lebih berakhir dengan bekas luka yang membesar.\nBuah matang berwarna oranye-merah dan memiliki diameter 2,0-2,5 cm.',7.0,NULL,'Beringin sangat akrab dengan budaya asli Indonesia. Tumbuhan berbentuk pohon besar ini sering kali dianggap suci dan melindungi penduduk setempat. Sesaji sering diberikan di bawah pohon beringin yang telah tua dan berukuran besar karena dianggap sebagai tempat kekuatan magis berkumpul. Beberapa orang menganggap tempat di sekitar pohon beringin adalah tempat yang “angker” dan perlu dijauhi.','1O1eLV6IDwJImolRROHPF0yokSQNLlhsF',''),(43,'Huru Minyak','Neolitsea triplinervia','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Tracheophyta\nKelas: Magnoliopsida\nOrdo: Laurales\nFamili: Lauraceae\nGenus: Neolitsea\nSpesies: Neolitsea triplinervia','Huru minyak merupakan pohon berukuran kecil hingga sedang. Secara vegetaatif memiliki daun tunggal dengan filotaksis folio distikha (berseling). Bentuk daun eliptikal dengan tulang daun membusur.','Huru minyak memiliki bunga dengan alat kelamin jantan dan individu terpisah atau istilahnya dikenal dengan dioecious. Bunga cauliflory karena menempel langsung pada batang. Tumbuh secara berkelompok dan berwarna putih.',5.0,NULL,'Sebaran spesies ini cukup luas dari Indo-Malaysia hingga Asia Timur hingga Australia. Huru minyak dapat menghasilkan minyak esensial dari aktivitas biologisnya','1SvC7jDa6n1YFve8iB7kLPcFm80IyRAhS',''),(44,'Ketapang','Terminalia catappa','Near Threatened (Hampir terancam)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Myrtales\nFamili: Combretaceae\nGenus: Terminalia\nSpesies:Terminalia catappa','Pohon besar, tingginya mencapai 40 m dan gemang batang sampai 1,5 m. Bertajuk rindang dengan cabang-cabang yang tumbuh mendatar dan bertingkat-tingkat; pohon yang muda sering tampak seperti pagoda. Pohon-pohon yang tua dan besar acap kali berbanir (akar papan), tingginya bisa hingga 3 m.\nDaun-daun tersebar, sebagian besarnya berjejalan di ujung ranting, bertangkai pendek atau hampir duduk. Helaian daun bundar telur terbalik, 8–25(–38) x 5–14(–19) cm, dengan ujung lebar dengan runcingan dan pangkal yang menyempit perlahan, helaian di pangkal bentuk jantung, pangkal dengan kelenjar di kiri-kanan ibu tulang daun di sisi bawah. Helaian serupa kulit, licin di atas, berambut halus di sisi bawah; kemerahan jika akan rontok.\n','Bunga-bunga berukuran kecil, terkumpul dalam bulir dekat ujung ranting, panjang 8–25 cm, hijau kuning. Bunga tak bermahkota, dengan kelopak bertaju-5, bentuk piring atau lonceng, 4–8 mm, putih atau krem. Benang sari dalam 2 lingkaran, tersusun lima-lima. Buah batu bulat telur gepeng, bersegi atau bersayap sempit, 2,5–7 x 4–5,5 cm, hijau-kuning-merah, atau ungu kemerahan jika masak.',3.0,NULL,'Pohon ini cocok dengan iklim pesisir dan dataran rendah hingga ketinggian sekitar 400 m dpl.; curah hujan antara 1.000–3.500 mm pertahun, dan bulan kering hingga 6 bulan. Ketapang menggugurkan daun hingga dua kali setahun, sehingga tumbuhan ini bisa tahan menghadapi bulan-bulan yang kering. Buahnya yang memiliki lapisan gabus dapat terapung-apung di air sungai dan laut hingga berbulan-bulan, sebelum tumbuh di tempat yang cocok.','1XFk3dyfwt0mEqznRp7Q96JSJ-sgeH05D','Cp40wmas7ctBZScF71gV2?usp=sharing'),(45,'Damar','Agathis dammara','Vulnerable (Rentan)','Kingdom: Plantae\nDivisi: Pinophyta\nKelas: Pinopsida\nOrdo: Pinales\nFamili: Araucariaceae\nGenus: Agathis\nSpesies: Agathis dammara','Pohon damar berukuran besar dan tingginya bisa mencapai 65 meter. Batangnya silindris dan lurus dengan diameter mencapai 1,5 meter. Kulit batang berwarna abu-abu muda hingga coklat kemerahan. Kulit mengelupas dalam keping-keping yang tidak beraturan dan biasanya bopeng karena resin.\nDaun berbentuk jorong (bulat memanjang) dengan panjang 6 – 8 cm dan lebar 2 – 3 cm. Bagian pangkal daun membaji sedangkan ujungnya runcing. Tulang daun sejajar dan banyak.','Bunga jantan dan betina berada pada tandan yang berbeda, pada pohon yang sama (berumah satu).',3.0,NULL,'Getahnya untuk dioleh menjadi kopal (manila copal).\nSelain itu kopal dimanfaatkan untuk campuran lak dan vernis, perekat pada penambal gigi, dan perekat plester.','1XHOTDf-QLEJ-8xFpQ854q6OnuHDhmg2s',''),(46,'Jabon','Anthocephalus cadamba','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Gentianales\nFamili: Rubiaceae\nGenus: Anthocephalus\nSpesies: Anthocephalus cadamba','Jabon termasuk pohon berukuran besar dengan batang lurus dan silindris serta memiliki tajuk tinggi seperti payung dengan sistem percabangan yang khas mendatar. Tinggi pohon dapat mencapai 45 m dengan diameter batang 100–160 cm dan kadang-kadang berbanir hingga ketinggian 2 m. Kulit pohon muda berwarna abu-abu dan mulus, sedangkan kulit pohon tua kasar dan sedikit beralur.\nDaun menempel pada batang utama, berwarna hijau mengilap, berpasangan dan berbentuk oval-lonjong (berukuran 15–50 cm x 8–25 cm). Daun pada pohon muda yang diberi pupuk umumnya lebih lebar, dengan posisi lebih rendah di bagian pangkal dan meruncing di bagian puncak.','Bunga terdiri dari kepala-kepala terminal bulat tanpa brakteol, bertangkai harum, berwarna oranye atau kuning. Bunganya biseksual, terdiri dari lima bagian, kelopak bunga berbentuk corong. Mahkota bunganya gamopetal berbentuk seperti cawan. Benang sarinya ada lima, melekat pada tabung mahkota dengan filamen pendek. Buahnya merupakan buah majemuk, berbentuk bulat dan lunak, dengan bagian atas terdiri dari empat struktur berongga atau padat. Buah jabon mengandung biji yang sangat kecil, berbentuk kapsul berdaging yang berkelompok rapat bersama untuk membentuk daging buah yang berisi sekitar 8.000 biji. Biji kadang berbentuk trigonal atau tidak teratur dan tidak bersayap.',4.0,NULL,'Kayu jabon dapat digunakan untuk bahan baku \nkayu lapis, konstruksi ringan, lantai, pulp dan kertas, \nlangit-langit, kotak, peti, mainan, ukiran, korek \napi, sumpit dan pensil','194zfHaNfj6prJ0ot7vfRERulIdRaLCbU','B1OGKE0YtcVCZxJnEAR33?usp=sharing'),(47,'Ketepeng China','Senna alata','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Tracheophyta\nOrdo: Fabales\nFamili: Fabaceae\nGenus: Senna\nSpesies: Senna alata','Tinggi pohon dapat mencapai 5 meter. Batang berkayu, berbentuk bulat, simpodial, kulit batang berwarna cokelat kotor.\nDaun ketepeng majemuk, tumbuh menyirip dengan jumlah genap, anak daun berkisar 8 hingga 24 pasang. Berbentuk bulat panjang dengan ujung tumpul atau oval dengan pinggiran daun rata, serta panjang daun antara 3,5-15 cm, dan lebar 2,5-9 cm. \n','Bunga ketepeng bunga majemuk, tandan. Kelopak bunga terbagi lima, dengan benangsari berjumlah tiga dan berwarna kuning. Daun pelindung bunga pendek, berwarna jingga kecoklatan, bunga berbentuk kupu-kupu, berwarna kuning keemasan dengan tumbuh mengarah (menghadap) keatas. \nBentuk buah Ketepeng polong, panjang18 cm dan lebar 2,5 cm. Buah muda berwarna hijau, saat sudah tua warnanya menjadi hitam kecoklatan. Biji Ketepeng segi tiga lancip, pipih, setelah tua mejadi hitam.',1.0,NULL,'Ketepeng kerap kali dimanfaatkan sebagai obat tradisional untuk mengobati penyakit luar (kulit) tubuh ketimbang dalam.','1XYgGgawnkCmyiIz4KNfkDnNSzQuDiH2H','P-qHLZDhntBCDUz3tji_e?usp=sharing'),(48,'Jambu Biji','Psidium guajava','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Myrtales\nFamili: Myrtaceae\nGenus: Psidium\nSpesies: Psidium guajava','Termasuk perdu atau pohon kecil dengan tinggi sekitar 2-10 m, percabangan banyak, batangnya berkayu, keras, kulit batang licin, menggelupas, berwarna cokelat kehijauan. Daun tunggal bertangkai pendek, letak berhadapan, daun berambut halus, permukaan atas daun licin, helaian daun bulat telur agak jorong, ujung tumpul, pangkal membulat, tepi rata, pertulangan menyirip.','Bunga tunggal, bertangkaim keluar dari ketiak daun, berkumpul 1-3 bunga, berwarna putih. Buah buni, berbentuk bulat sampai bulat telur, daging buah tebal, berwarna putih kekuningan atau merah jambu, biji buah mengumpul di tengah, kecil-kecil, keras dan, berwarna kuning kecoklatan.',5.0,NULL,'Daunnya digunakan sebagai obat diare. Tanaman ini digunakan dalam banyak produk sampo yang berbeda untuk aromanya. Ini juga menjadi spesies bonsai yang populer dan saat ini cukup populer di India dan Asia Timur.','14Fgcv6IXEt8vucX3P-TxeReu5P7KREzJ','HRYL1RwBdUp8wADjgI7Ba?usp=sharing'),(49,'Jambu Air','Syzygium aqueum','Langka','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Myrtales\nFamily: Myrtaceae\nGenus: Syzygium\nSpecies: Syzygium aqueum','Biasanya tumbuh setinggi 6 - 10 meter, terkadang hingga 15 meter, sementara spesimen sesekali hingga 27 meter telah tercatat di New Guinea. Batang jarang berdiameter lebih dari 30 cm, dan biasanya bercabang dari cukup rendah ke bawah, meskipun pada spesimen terbesar diameternya bisa mencapai 60cm dan bebas cabang sejauh 10 meter dengan penopang di dasarnya. \n','Buahnya berkulit sangat tipis, berwarna merah ketika matang.',1.0,NULL,'Kayunya digunakan untuk alat musik, gagang perkakas, komponen furnitur, pembuatan kapal, pertukangan berat, lantai, bengkel tukang kayu','1r0iuTvxGuB-e2pL1fyfObGZoP2E-D-IS','qwct0cIw8dLs1qWTVL5tO?usp=sharing'),(50,'Jakaranda','Jacaranda mimosifolia','Vulnerable (Rentan)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Lamiales\nFamily: Bignoniaceae\nGenus: Jacaranda\nSpecies: Jacaranda mimosifolia','Pohon ini tumbuh hingga ketinggian hingga 20 m (66 kaki). Kulitnya tipis dan berwarna abu-abu kecokelatan, halus ketika pohon masih muda tetapi akhirnya menjadi bersisik halus. Rantingnya ramping dan sedikit zigzag; mereka berwarna coklat kemerahan muda.\nDaun memiliki panjang hingga 45 cm (18 in) dan majemuk menyirip ganda, dengan selebaran sedikit lebih dari 1 cm (0,39 in) panjangnya. Ada formulir putih yang tersedia dari pembibitan.\n','Bunganya memiliki panjang hingga 5 cm (2,0 inci), dan dikelompokkan dalam malai berukuran 30 cm (12 inci). Berbunga di musim semi dan awal musim panas, dan bertahan hingga dua bulan. Mereka diikuti oleh polong biji berkayu, berdiameter sekitar 5 cm (2,0 in), yang berisi banyak biji pipih bersayap. Polong keras, yang berukuran 5,1 sampai 7,6 cm.',6.0,NULL,'Kepanikan ungu adalah istilah yang digunakan oleh siswa di Queensland tenggara untuk siswa selama periode akhir musim semi dan awal musim panas. \"Ungu\" mengacu pada bunga pohon Jacaranda, yang mekar pada waktu itu dan telah ditanam secara luas di seluruh distrik itu. Kata \"panik\" mengacu pada kebutuhan untuk menyelesaikan tugas dan belajar untuk ujian akhir. \n\nJacaranda saat mekar juga dikenal sebagai pohon ujian.\n\nSebaliknya, saat jacaranda mekar di Pretoria bertepatan dengan ujian akhir tahun di Universitas Pretoria , legenda mengatakan bahwa jika bunga dari jacaranda jatuh di kepala siswa, siswa akan lulus semua ujian mereka.','1DBhdWG978dXjcRMCSdR1V-abPrw7s4my','mMesRR_K5Qr48GOnznfBh?usp=sharing'),(51,'Kayu Putih','Eucalyptus alba','Endangered (Terancam)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Myrtales\nFamily: Myrtaceae\nGenus: Eucalyptus\nSpecies: Eucalyptus alba','Pohon dengan kulit kayu licin dan menggelupas memanjang tidak teratur, tinggi pohon dapat mencapai 40 m, tidak berbanir, kulit batang bagian luar berwarna cokelat hingga cokelat muda. Daun berbentuk tombak hingga telur, pangkal daun mengecil hingga ke ujung meruncing, kedudukan berhadapan atau tersebar.','Kuncup bunga dalam kelompok tujuh, bunga putih, bunga memanjang tidak bertangkai dan buah berbentuk kerucut hingga setengah bola.',6.0,NULL,'Daun terkenal mempunyai kandungan minyak didalamnya. Dalam jumlah sedikit daunnya berguna meredakan batuk sehingga banyak dibuat sebagai permen','1FEdA7wrOIQq05IR9nBuNrsgPpexgzlp2',''),(52,'Kingkilaban','Mussaenda frondosa','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Gentianales\nFamily: Rubiaceae\nGenus: Mussaenda\nSpecies: Mussaenda frondosa','Perdu memanjat dengan tinggi 2-5 m. Seluruh bagiannya berbulu. Daun tunggal, bentuk bulat telur hingga melonjong. Tangkai daun pendek, kedudukan daun berhadapan, dan memiliki daun oemikat warna putih-kehijauan.','Perbungaan malai, berwarna kuning jingga. Bunga berbentuk terompet. Kelopak besar berwarna putih. Mahkota berukuran 1 1/4-1 1/2 inchi. Tangkai putik cokelat-oranye, berukuran 1 inchi dengan warna terang pada mulut. Buah buni menyempit berwarna hijau muda dan hitam pada saat tua.',5.0,NULL,'Mudah menarik perhatian kupu-kupu dan dikenal sebagai makanan tupai.','1b06qgSiCEzXgp0Cpqs-b09AQ0vy4455R',''),(53,'Laban','Vitex pinnata','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Lamiales\nFamily: Lamiaceae\nGenus: Vitex\nSpecies: Vitex pinnata','Tinggi pohon mencapai 2-15 m, diameter hingga 40 cm. Kulit retak, terkelupas, warna abu-abu kekuningan hingga cokelat pucat. Gubal warna kuning lembut sampai cokelat. Daun 3 atau 5 foliolate. Leaflet hampir sessile, ovate atau elips, berukuran 3-25 cm, lebar 1,5-10 cm, dasar bulat sedikit berbentuk baji, ujungnya accuminate.','Inflorescence malai terminal. Bunga berwarna biru keputihan. Buah berukuran 5-8 mm dengan warna hitam saat matang.',3.0,NULL,'Pohon yang tumbuh lambat dan mempunyai daun yang wangi. kayunya sangat kuat dan tahan lama sehingga digunakan untuk kostruksi dan pembuatan pisau. Daun dan kulit kayu digunakan sebagai obat sakit perut, demam, dan malaria serta disentri.','1beuRZv8dKPndfVFqQFxQqEOu31tkA2_O',''),(54,'Sulastri','Calophyllum soulattri','Low risk (Risiko rendah)','Kingdom:Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Malpighiales\nFamili: Clusiaceae\nGenus: Calophyllum\nSpesies: Calophyllum soulattri','Pohon dengan tinggi mencapai 30 m dan diameter 70 cm, tidak berbanir. Batang silindris, lurus, kulit abu-abu. Daun tunggal, berhadapan berseling, berbentuk bundar telur hingga jorong atau melonjong, berukuran 6,5-29 cm * 2,4-10 cm, pertulangan sekunder sejajar dan rapat.','Bunga majemuk dengan bunga jantan dan betina. Diameter bunga 10 mm berwarna putih. Buah berdiameter 2 cm, warna hijau pucat dan berdaging.',4.0,NULL,'Kayunya dimanfaatkan untuk bahan konstruksi dan pulp. Buah digunakan sebagai bahan biofuel. Akar digunakan untuk melawan nyeri rematik','1UwDguwz1rE5EF2mxLLF9jV6gBto6-3iB',''),(55,'Bunga Kupu-Kupu','Bauhinia purpurea','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Fabales\nFamily: Fabaceae\nGenus: Bauhinia\nSpecies: Bauhinia purpurea','Pohon berukuran sedang dengan tinggi mencapai 5 m. Kulit batang berwarna cokelat keabu-abuan. Daun berukuran 10-20 cm, berwarna hijau dengan bentuk menyerupai sayap kupu-kupu, bagian pangkal membulat ganda dan bagian ujungnya juga ganda melonjong.','Bunga berwarna merah muda, terdiri dari 5 kelopak dan mempunyai aroma yang harum',1.0,NULL,'Sering ditanam di pinggir jalan atau sebagai tanaman hias. Banyak digunakan sebagai tanaman obat untuk berbagai penyakit.','17KgRh_jpsPkxSy2q9XWHbwW425ovsemP',''),(56,'Kanyere','Bridelia glauca','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida \nOrdo: Euphorbiales\nFamili: Euphorbiaceae\nGenus: Bridelia\nSpesies: Bridelia glauca','Kanopi pohon rendah, tinggi mencapai 25 m, diameter 45 cm. Stipules sekitar 10 mm. Daun alternate, sederhana, vena menyirip, berbentuk hati kecil dengan warna dasar bagian atas dan bawah berimbang.','Bunga berukuran 3 mm, berwarna kuning-hijau, tersusun dalam bundel padat di ketiak daun. Buah berukuran 8 mm, warna kemerahan-ungu-biru, memiliki kapsul dengan biji merah.',7.0,NULL,'Secara lokal kayu digunakan untuk tempat merambat budidaya lada. Kayunya juga digunakan untuk membangun rumah dan jembatan. Buahnya dapat dimakan','1aW-dtzWiH3b86lJ4KkV_U6NGO5pusQYX','nseZQ0uA14SSKYc0RblWW?usp=sharing'),(57,'Kendal','Cordia dichotoma','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Tracheophyta\nKelas: Magnoliopsida\nOrdo: Boraginales\nFamili: Boraginaceae \nGenus: Cordia\nSpesies: Cordia dichotoma','Pohon kendal merupakan pohon yang berukuran kecil sampai sedang dengan arsitektur seperti pohon peneduh. Kulit batang berwarna coklat keabu-abuan, halus atau berkerut memanjang. Daun berbentuk eliptikal - oblong.','Bunganya bertangkai pendek, biseksual, berwarna putih yang hanya terbuka pada malam hari. Buahnya berwarna kuning atau merah muda-kuning globose bersinar yang berubah menjadi hitam saat matang dan pulp menjadi kental.',1.0,NULL,'Tanaman cepat tumbuh yang serbaguna, daunnya menghijau sepanjang tahun, bagus untuk peneduh, taman, reboisasi dan penghijauan. Kayunya dapat digunakan untuk mebel, kayu pertukangan dan bangunan kelautan.','18-et80po5XCxF59uZUW042tAmH6_8mtV','umbMh-rS9joH1zzWkuf1c?usp=sharing'),(58,'Kiara Condong','Ficus altissima','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Tracheophyta\nKelas: Magnoliopsida\nOrdo: Rosales\nFamili: Moraceae\nGenus: Ficus\nSpesies: Ficus altissima','Ficus altissima adalah pohon hutan besar yang selalu hijau, tumbuh hingga 30 m (98 kaki), dengan tajuk yang menyebar dan seringkali batang berbantalan ganda, kulitnya halus dan abu-abu, dengan pustula kecil berwarna coklat pucat. Cabang-cabangnya menyebar dan ranting-rantingnya berbulu dan sering berwarna hijau ketika muda. Daunnya berselang-seling, elips hingga bulat telur, dengan seluruh tepi dan hingga 100 kali 40 mm. batang pendek dan memiliki stipula berselubung. \n','Perbungaan hypanthodium tumbuh secara cauliflory (menempel pada batang). Buah sikonium berwarna merah-oranye, berbiji banyak. Ukuran bunga yang sudah mengalami penyerbukan sebesar 25 mm',3.0,NULL,'Pohon kiara condong menjadi inspirasi untuk nama suatu daerah di kota Bandung. Daerah tersebut dinamai Kiara Condong.','1kQBU6zVhTppl5KhoOfrDsmGhijWCM5X1','VbzflBaabYtFMtXxf8pa7?usp=sharing'),(59,'Bambu','Bambusa sp.','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Poales\nFamily: Poaceae\nGenus: Bambusa\nSpesies: Bambusa sp.','Bambu tergolong rumput-rumputan raksasa, berumpun tegak dan terdiri dari sejumlah batang yang tumbuh secara bertahap mulai dari rebung, batang muda, hingga dewasa. Batang berbentuk silindris, berbuku-buku, beruas-ruas berongga, berdinding keras, setiap buku terdapat mata tunas atau cabang. Batang memiliki tinggi 10-20 m, diameter 4-10 cm. Permukaan batang ditumbuhi bulu-bulu halus, memiliki lapisan lilin ketika muda dan hilang saat dewasa. Daunnya lurus berbentuk segitiga lebar dengan panjang 4-5 cm, lebar 5-6 cm, ujung daun meruncing, permukaan ditumbuhi bulu halus dan sedikit bergerigi','Perkembangbiakan melalui tunas atau disebut rebung yang pelepahnya ditumbuhi bulu-bulu halus. Rebung tumbuh dari kuncup akar rimpang di dalamtanah atau pangkal buluh yag sudah tua',1.0,NULL,'Merupakan salah satu tanaman dengan pertumbuhan paling cepat karena memiliki sistem rhizoma-dependen unik yang dalam sehari dapat tumbuh sepanjang 60 cm atau lebih bergantung pada kondisi lokal tanah, iklim, dan spesiesnya. Mempunyai banyak manfaat sebagai bahan kerajinan, makanan hewan, dan rebungnya juga bisa diolah sebagai masakan.','14PA4NsLwVt3CNdxLXgrZlLS-6rv3_3EA',''),(60,'Lea','Leea rubra','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Vitales\nFamily: Vitaceae\nGenus: Leea\nSpesies: Leea rubra','Ketinggian batang dapat mencapai 1-3 m, dengan petiole 4-20 cm, daun alternate dengan panjang 20-50 cm. berwarna hijau gelap.','Bunga inflorescence 3-6 panjang peduncle dari sisi berlawanan daun. Hermafrodit dengan diameter 5 mm. Kaliks berwarna merah. Buah subglobus berdiameter 1 cm dengan kelopak persisten. Berwarna hijau ketika muda, lalu menjadi merah dan ungu kehitaman ketika masak.',2.0,NULL,'Daun dan akar digunakan sebagai obat tradisional untuk beberapa penyakit.','1q0nC6UE8ZPkRk6W78c4nwm9p5Y2SrK4V',''),(61,'Sonokeling','Dalbergia latifolia','Vulnerable (Rentan)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Fabales\nFamili: Fabaceae\nGenus: Dalbergia\nSpesies: Dalbergia latifolia','Pohon berukuran sedang-besar dengan tinggi mencapai 43 m dan diameter 180 cm. Batang silindris, percabangan simpodial, bertajuk lebat berbentuk kubah. Menggugurkan daun ketika musim kemarau. Permukaan kulit batang kasar, sedikit pecah-pecah dan membujur halus, warna abu-abu kecokelatan sampai hitam. Berakar tunggang warna putih kecokelatan. Daun majemuk berseling, anak daun oval lonjong simetris, tulang daun menyirip ganjil. Ujung daun tumpul, pangkal runcing, tepi rata, licin, halus berwarna hijau.','Berbunga sempurna majemuk berbentuk malai, terletak di ketiak daun. Dasar kelopak berlekatan membentuk tabung, panjang 3-5 mm, mahkota lepas, halus, panjang 4-6 mm, warna putih-merah muda. Buah polong, pipih lanset memanjang, runcing di pangkal dan ujungnya dengan panjang 3-5 cm warna hijau waktu muda dan cokelat ketika masak. Buah tidak memecah, berbiji 1-4 biji berbentuk ginjal pipih.',5.0,NULL,'Pohon andalan untuk rehabilitasi, kayunya dimanfaatkan dalam mebel, ukiran dan sebagainya. Buahnya untuk obat dan kulit batang yang segar digunakan untuk pembersihan darah.','176fCwJBCyLdQIBY1VKEWlniUdCrrBN9T',''),(62,'Kisireum','Syzygium gracile','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Myrtales\nFamili: Myrtaceae\nGenus: Syzygium\nSpecies: Syzygium gracile','Pohon berukuran kecil, daun memanjang sampai lanset, ujung daun meruncing, dasar daun melancip','Perbungaan muncul di ketiak daun dan ujung ranting, memanjang, terdiri dari 1-3 bunga. Buah jorong sampai bulat, pada ujung buah terdapat sisa kelopak bunga yang tidak luruh.',4.0,NULL,'Banyak tersebar di Malaysia, Indonesia dan Filipina. Pohonnya sebagai peneduh, kulit kayu dapat dijadikan bahan pewarna.','1PW5cwSavwLhseVdSmr43vhBav9GaAZxv',''),(63,'Bisoro','Ficus hispida','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Rosales\nFamily: Moraceae\nGenus: Ficus\nSpecies: Ficus hispida','Berhabitus pohon dengan ketinggian mencapai 15 m, batang berwarna cokelat atau abu-abu bercabang banyak, bergetah. Daun berbentuk jantung, ujung meruncing, dan berbulu. Percabangan opposite dengan permukaan atas dan bawah memiliki bulu kasar berwarna putih atau cokelat. ','Tumbuhan berumah dua. Buah bergerombol sekitar 10-20 buah dalam satu tandan. Buah memiliki lapisan epidermis dengan kutikula. Bagian mesokarp besar berbentuk oval.',1.0,NULL,'Sebagian besar dimanfaatkan dalam pegobatan tradisional untuk berbagai penyakit. Buahnya kaya akan kalsium, fosfor, dan zat besi dengan tekstur daging lembut dan berbiji kecil. Buahnya tumbuh sepanjang tahun.','1-6WfrM78T-gijSIwt6LfC7CwzEhdwrCB',''),(64,'Mareme','Glochidion rubrum','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Euphorbiaceae\nFamili: Euphorbiaceae\nGenus: Glochidion\nSpesies: Glochidion rubrum','Kanopi pohon lebih rendah, ketinggian 26 m, diameter 30 cm. Barcts sekitar 2,5 mm. Daun alterbatif, sederhana, vena menyirip, bagian bawah berbulu.','Bunga berdiameter 3 mm, berwarna putih hingga merah muda, terletak di bundel aksila. Buah berukuran sekitar 4 mm, berwarna putih, merah muda, hingga merah. berbentuk kapsul. Biji tetap pada kapsul jika terbuka.',2.0,NULL,'Daun dapat digunakan sebagai obat sakit perut. Buahnya dapat dimakan.','1DBpbMwWXOzmv-EotOoQyio3h1XfdHreM',''),(65,'Gempol','Nauclea orientalis','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Gentianales\nFamily: Rubiaceae\nGenus: Nauclea\nSpecies: Nauclea orientalis','Pohon dengan tinggi mencapai 35 m, diameter 50 cm. Tumbuhan yang menggugurkan daun (deciduous). Kulit kayu licin, warna kelabu-cokelat kemerahan. Kayu berwarna orange-kuning. Daun tunggal, kedudukan berhadapan berseling, bentuk bundar telur hingga lonjong dengan ukuran 7-30 * 4-18 cm. Permukaan atas daun hijau mengkilap dan licin, bagian bawah hijau pucat dengan tulang daun menonjol berwarna kuning. ','Bunga kecil, wangi, warna kuning-orange dengan bebang sari berwarna putih. Buah bulat seperto bola golf dengan diameter 4-5 cm, warna cokelat beraroma kuat. Biji kecil berbentuk bundar telur atau jorong berukuran 1-10 mm, tidak bersayap dan rekalsitran.',1.0,NULL,'Banyak dimanfaatkan sebagai tanaman hias. Buah sebagai pakan kelelawar, monyet dan burung. Kayu dijadikan frame, kertas atau hiasan. Daun muda untuk obat sakit perut dan menurunkan tekanan darah. Pepagannya sebagai racun ikan dan ekstraknya digunakan untuk obat malaria, anti kanker dan bahan bedak.','1OtdJQSnoVgjZB6hFu2XfrbIyC4WB9H0X','AFj9qOs9lFqofZPxkTdh3?usp=sharing'),(66,'Lamtoro','Leucaena leucocephala','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Fabales\nFamily: Fabaceae\nGenus: Leucaena\nSpecies: Leucaena leucocephala','Perdu atau pohon kecil dengan tinggi 2-10 m, batang pohon keras, tidak besar, batang bulat silindris, bagian ujung merambat rapat. Daun majemuk terurai dalam tangkai, menyirip genap ganda, anak daun kecil 5-20 pasang. Bentuk daun lanset, ujung runcing, tepi rata, panjang 6-21 mm dan lebar 2-5 mm.','Bunga majemuk terangkai dalam karangan berbentuk bongkol, bertangkai panjang, berwrana putih kekuningan. Buah mirip petai tapi berukuran kecil dan lebih tipis. Berbuah polong berisi biji kecil berjumlah banyak, pipih, tipis bertangkai pendek. panjang 10-18 cm, lebar 2 cm dan diantara biji ada sekat. Biji berwarna cokelat kehijauan atau cokelat tua dan licin mengkilap.',1.0,NULL,'Sering dipakai untuk pupuk hijau dan ditanam sebagai tanaman pagar. Daun muda, tunas bunga, dan polong dapat dimakan sebagai lalap atau dimasak. Seluruh bagian tanaman dapat digunakan untuk mengobati beberapa penyakit.','1XJiW3lILyvuouUmCPyM0ApxVuNY3EmJk',''),(67,'Kiangrit','Distylium stellare','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Saxifragales\nFamili: Hamamelidaceae\nGenus: Distylium\nSpesies: Distylium stellare','Daun memiliki ujung seperti kelenjar, menebal, ketika dewasa gundul atau lambat gundulnya, tangkai daun 1/3-10 cm, stipula lanset hingga linier, lancip di puncaknya, stellate tipis.','Paku atau rasemus panjang, berbunga agak rapat 3-6, runcing atau sering bercabang, bagian aksial stellate berbulu, bracts lanset, filamen panjang 1,5-2 mm, kepala sari panjang 1.5-2 mm, ovarium bulat telur, tomentose bintang berwarna coklat tua pekat, buah ellipsoid sampai ovoid, berwarna putih-coklat.',1.0,NULL,'Distribusi mencakup Malaysia, Sumatera, Jawa. Tumbuh di hutan hujan campuran dengan ketinggian 1000-2700 m dpl. Berbunga pada April-November dan berbuah pada Juni-Oktober.','1RhFefL4HE3u1if_O2S63CmiuVNq6xs87','FiyQNDClhLU2Gk19AeoNH?usp=sharing'),(68,'Putat Laut','Planchonia valida','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Ericales\nFamili: Lecythidaceae\nGenus: Planchonia\nSpesies: Planchinia valida','Pohon dapat mencapai tinggi 50 m, diameter 200 cm, batang tegak, lurus, dan berbanir. Tajuk bulat, lebat, berwarna hijau tua dan mengkilat. Pada musim kering daun gugur dan sebelum gugur berwarna merah. Kulit batang cokelat ke-abu-abuan hingga cokelat tua, menggelupas dalam bentuk kepingan kecil. Daun tunggal, tipis, mengkilat, tepi bergerigi.','Perbungaan berbentuk tandan. Mempunyai banyak benang sari, berwarna merah jambu pada bagian bawah dan putih di bagian atas. Buah berbentuk bulat telur atau lonjong.',1.0,NULL,'Merupakan tumbuha liar yang banyak terdapat hidup di Malaya, Sumatra, kalimantan, Jawa, Sulawesi, Bali, Lombok dan timur. Kayunya digunakan untuk perumahan, konstruksi berat dan perabot rumah tangga.','1MsoObqqzG19h5NApIms4IIvFi_13uIe_','rlmahvpQAzQ8nKJgd3_oQ?usp=sharing'),(69,'Kateng','Cynometra ramiflora','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Fabales\nFamily: Fabaceae\nGenus: Cynometra\nSpecies: Cynometra ramiflora','Pohon yang selalu hijau dan tumbuh sampai setinggi 4-26 m, berdiameter sampai 30 cm. Daun majemuk dengan satu dan jarang dua pasang anak daun. Daun muda berwarna merah muda. Anak daun ovatus elips, berdaging, dasar daun membulat, ujung runcing, pertulangan daun 8-16 pasang','Bunga berbentuk infloresensi liontin ditutupi barcts yang besar, mencolok, menarik dan berwarna keperakan. Kelopak berwarna putih. Buah asimetris, berbentuk kacang bulat besar 45 × 39 × 34 mm, berwarna cokelat karat berkayu dan berbiji soliter.',1.0,NULL,'Dimanfaatkan untuk diambil kayunya sebagai obat. Kadang ditanam sebagai tanaman hias','1o7dZogsaNUkxfvdpom9-2hbFttuSAd1o','tVKo_7SV22pMsr6RVpQnO?usp=sharing'),(70,'Pucuk Merah','Syzygium oleana','Low risk (Risiko rendah)','Kingdom: Plantae\nDivisi: Tracheophyta\nKelas: Magnoliopsida\nOrdo: Myrtales\nFamili: Myrtaceae\nGenus: Syzygium \nSpesies: Syzygium oleana','Berakar tunggang yang merambat,berwarna cokelat dan berbentuk bulat. Batng bulat, berkayu, dengan tinggi mencapai 5 m. Daun berbentuk oval, lancip pada ujung daun, berwarna merah saat muda dan menjadi seiring waktu.','Bunga majemuk yang tersusun dalam malai berkarang terbatas. Putik berwarna putih dan bertangkai pendek dibanding benang sarinya. Letak putik ditengah sedangkan tangkai sari berwarna putih lebih panjang dari putik dan memiliki jumlah yang banyak. Buah berbentuk bulat agak pipih dan terdapat cekungan pada bagian tengah permukaan atas buah. Buah berdiameter 0,7 cm dan berwarna hitam mengkilat saat tua.',2.0,NULL,'Digunakan sebagai tanaman hias dan sering ditanam di pinggir jalan, halaman atau pekarangan rumah. Pohon ini mampu merehabilitasi lahan, mencegah longsor, dan menyimpan cadangan air.','1wBj-z7T4xJFDokDllDZ62RvbzWgINaKf','NrRZ0_nv1RbXRj-1AOfw6?usp=sharing'),(71,'Saga','Adenanthera pavonina','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Fabales\nFamili: Fabaceae\nGenus: Adenanthera\nSpesies: Adenanthera pavonina','Pohon berukuran sedang yang tingginya dapat mencapai 40 m, diameter mencapai 45 cm bahkan lebih. Pohon ini menggugurkan daun, umumnya tidak berbanir, permukaan kulit batang beralur berwarna cokelat keabu-abuan, kulit bagian dalam lunak berwarna cokelat pucat. Tajuk menyebar tidak merata. Daun tersusun spiral dengan panjang 15-55 cm, berbentuk lonjog, menyirip rangkap dengan 2-6 pasang sirip. Anak daun 4-10, berbentuk bundar telur, bertepi rata, berdaun penumpu kecil dan berbulu.','Perbungaan terminal atau diketiak daun, berbunga banyak, menyerupai tandan dengan panjang 12-30 cm termasuk gagang bunga. Bunga kecil warna putih kekuningan, terdiri dari 5 bagian, sedikit berbulu, daun bermahkota lonjong, bulu jarang. Buah berbentuk polong berwarna cokelat, dengan ukuran polong 15-25 cm x 1,3-1,8 cm, polong memuntir, biji mencapai 25 biji. Biji berwarna merah, mengkilap, lonjong, agak bundar telur terbalik, ukuran biji 7 –9 mm x 7–9,5 mm, cembung.',14.0,NULL,'Tumbuhan yang berasal dari Asia Selatan. Biasanya digunakan sebagai peneduh. Dahulu bijinya digunakan sebagai penimbang emas karena beratnya yang konstan. Biji dapat digunakan sebagai energi alternatif (biodiesel).','1Ayso7hdaqHRVZEO6-eV-O4-9_oL7sZKM','MV5z5QM2_0HQKZXxWonOm?usp=sharing'),(72,'Bunut','Ficus virens','Not extinct (Tidak punah)','Kingdom: Plantae\nDivisi: Magnoliophyta\nKelas: Magnoliopsida\nOrdo: Rosales\nFamily: Moraceae\nGenus: Ficus\nSpecies: Ficus virens','Berhabitus pohon dengan ketinggian mencapai 30 m lebih dan diameter mencapai 2 m. Sistem percabangan simpodial dan panjang percabangan dapat melebihi batang. Kulit batang kasar berwarna kecokelatan. Daun tunggal, kedudukan tersebar, berbentuk oval memanjang, ukuran panjang 5-12 cm dan lebar 3-4 cm. Permukaan daun halus, berwarna hijau, tepi daun rata, ujung runcing dan tulang daun menyirip.','Bunga majemuk dalam malai yang terletak pada ujung ranting. Mahkota bunga berwarna kuning, kelopak bunga berbentuk jorong dan bercangap, mahkota bunga berwarna kuning terang dan berbentuk bulat. Bunga bersifat hemafrodit. Buah buni berbentuk bulat warna hijau saat muda dan berwarna kuning setelah tua dan merah jambu setelah masak. Diameter buah berukuran 1-2 cm. Biji berwarna cokelat dan menggerombol di dalam buah.',1.0,NULL,'Dimanfaatkan untuk melestarikan sumber air, mencegah abrasi lahan di tepi sungai, meningkatkan daya dukung habitat satwa, meningkatkan kualitas udara, dan mencegah erosi. Daun mudanya dijadikan bahan sayuran.','1vFS_-YLly7upvk1uk9qYDCIXlEJWBqZy','COgn35imWRqysdh3vN-lI?usp=sharing'),(73,'Sindur','Shorea javanica','EN (Endangered)','Kingdom: Plantae\nDivisi: Tracheophyta\nKelas: Magnoliopsida\nOrdo: Malvales\nFamili: Dipterocarpaceae\nGenus: Shorea\nSpesies: Shorea javanica','Pohon besar, dengan tinggi kemuncak mencapai 40-50 m, batang bebas cabang hingga 20(-30) m, gemang batang hingga 150 cm garis tengahnya, dan tinggi banirnya hingga 1,5 m; permukaan kulit kayu memecah tak beraturan, kulit kayu bagian luar tebal dan kecokelatan, sementara kulit kayu bagian dalam keputihan terlapis pita kuning-jingga, mengeluarkan getah (resin) bening, keputihan atau kekuningan. Tajuk pohon tua membulat atau serupa kubah, percabangan simpodial.\nDaun jorong lonjong hingga bundar telur, tipis, serupa jangat, (6,5-)10-15 × (3,5-)4-8 cm, ujung penetesnya (acumen) hingga 7 mm, dengan 19-25 pasang tulang daun sekunder, tulang daun tersier berpola tangga (scalariform); tangkai daun sepanjang 16-22 mm.','Kuncup bunga elipsoid, hingga 10 × 5 mm; kelopak bundar telur sempit, meruncing, agak tak-sama; mahkota putih; benang sari 15. Buah samara bersayap-5 yang merupakan perpanjangan kelopak, tiga di antaranya memanjang hingga 18 × 1,5 cm, serupa sudip, berujung tumpul; pangkalnya serupa mangkuk yang bersama-sama membentuk kantung pelindung buah.',35.0,NULL,'Shorea javanica menghasilkan resin yang dalam perdagangan dikenal sebagai damar mata kucing. Resin ini digunakan dalam industri cat, vernis, linoleum, juga dalam industri farmasi, kosmetika, serta bahan aditif pangan. Secara tradisional, damar dipakai untuk penerangan (lampu damar), memakal perahu dan keranjang, dan mewarnai batik. Damar mata kucing merupakan resin beku berbentuk bongkahan, yang bening transparan, tak berwarna atau sedikit kekuningan.','1xCXB6Y7bXnusPxfs7dLUplbWMmI0LRLm','KoCPEELy-LXMJNrWTYKTa?usp=sharing'),(74,'Saninten','Castanopsis argentea','EN (Endangered)','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Fagales\nFamili: Fagaceae\nGenus: Castanopsis\nSpesies: Castanopsis argentea','Pohon Saninten (Castanopsis argentea) memiliki tinggi 35 hingga 40 meter. Kulit batangnya berwarna hitam, kasar dan pecah-pecah dengan permukaan tidak rata. Terdapat alur-alur memanjang pada batang yang tak lain adalah garis empulur yang menonjol keluar. \nDaun tunggal berseling, berbentuk lancip memanjang (lanset). Permukaan daun berlilin dan bagian bawahnya berwarna abu-abu keperakan ditutupi bulu-bulu menyerupai bintang atau sisik yang lebat. ','Buahnya dihiasi dengan duri bercabang mirip rambutan. Setiap cangkir buah berisi satu hingga empat kacang yang dapat dimakan berbentuk oval atau pipih dan memiliki ukuran hingga 2,5 cm (0,98 inci). Tangkai buah memiliki panjang hingga 1,5 cm (0,59 in).',40.0,NULL,'Castanopsis argentea adalah pohon cemara asli Indonesia, di mana ia dikenal sebagai sarangan . Hal ini banyak ditemukan di hutan yang tidak terganggu di Jawa Barat sekitar Gunung Gede Pangrango dan Gunung Halimun Salak.','1Rlgv2-VcfzBwKpQP3L7uzbLQvUZqJB5X','tcdy41jUbJFCkVKTVXJhC?usp=sharing'),(75,'Gaharu buaya','Aetoxylon sympetalum','Dilindungi','Kingdom: Plantae\nDivisi : Magnoliophyta\nKelas : Magnoliopsida\nOrdo: Malvales\nFamili: Thymelaeaceae\nGenus: Aetoxylon\nSpesies: Aetoxylon sympetalum','Aetoxylon sympetalum tumbuh sebagai pohon setinggi 40 meter (130 kaki), dengan diameter batang hingga 60 sentimeter (24 in). Kulit batang berwarna coklat tua sampai hitam. ','Buah berwarna coklat kemerahan, dengan diameter hingga 5 sentimeter.',27.0,NULL,'Aetoxylon adalah spesies tunggal ( monotypic ) dan hanya ditemukan (endemik) di Kalimantan.','1svieNiywyxJhYGztDWXGdDC24Sd58X8Q',''),(76,'Damar putih','Agathis labillardieri','NT (Near Threatened)','Kingdom: Plantae\nDivisii: Pinophyta\nKelas: Pinopsida\nOrdo: Pinales\nFamili: Araucariaceae\nGenus: Agathis\nSpesies: Agathis labillardieri','Pohon setinggi 60 m dengan diameter maksimal 2 m. Pohon damar putih memiliki kulit batang berwarna coklat tua dengan kulit batang lepas berkotak. Macam daun damar adalah daun majemuk pinnatus. Bentuk daun lonjong atau elips dengan panjang 7,5-10 cm dan lebar 1,8-3 cm. Tekstur daun coriaceous dengan permukaan mengkilap di bawah.','Strobilus jantan damar putih berbentuk lebar silinder dengan tangkai pendek sekitar 1-2 mm. Sedangkan, strobilus betina berbentuk bulat, panjang 7,5-8,5 cm dengan lebar 6 cm berwarna kehijauan dan sisik imbricate/berselingkupan. Sporofil atau benihnya berukuran panjang 1 cm kali lebar 8 mm, dengan sayap kecil yang berbeda.',38.0,NULL,'Spesies ini ditemukan di Indonesia dan Papua New Guinea.','1UClSPnEe5z6m7e7t7YyRBeHwGD0GePCD','');
